100.body:
When we last modeled binary search trees , we defined what it meant to be a binary tree, and had two different candidates for the BST invariant. Now we'll return to BSTs and model the classic recursive BST search algorithm. Just like games of tic-tac-toe, a BST search can be represented as a sequence of states that evolve as the algorithm advances. As a reminder, we had defined binary-tree nodes like this: sig Node { key: one Int, -- every node has some key left: lone Node, -- every node has at most one left-child right: lone Node -- every node has at most one right-child
} Just like in the last example, we'll start by adding a sig for the state of the system. The "system" here is the recursive search, so it should have fields that are used in that context. Really, the only thing that changes during the recursive descent is the node currently being visited: -- Since a BST descent doesn't need to backtrack, the state can be fairly simple.
sig SearchState { current: lone Node -- the node currently being visited
} Then we'll define a one sig for the overall search. As with tic-tac-toe, Forge will find instances that represent a single search, embodied by the Search atom and its fields: one sig Search { target: one Int, -- the target of the search (never changes) -- The first state and successor-state function for this trace initialState: one SearchState, nextState: pfunc SearchState -> SearchState
} What does an initial state of the search look like? We'd better be at the root of the tree! pred init[s: SearchState] { isRoot[s.current]
} Now for the more complicated part. How does a step of the recursive descent work? At any given node: First, it checks whether current.key = target. If yes, it's done. It checks whether current.key < target. If yes, it moves to the left child if it exists, and returns failure otherwise. It checks whether current.key > target. If yes, it moves to the right child if it exists, and returns failure otherwise. That's not so bad, but it feels like there are two different kinds of transition that our system might take. Let's give each of them their own predicates, just to avoid them getting tangled with each other: descendLeft will apply if the target is to the left. descendRight will apply if the target is to the right. If neither can apply, the algorithm is done: either the target has been found, or the search has "hit bottom" without finding the target. Let's start writing them, beginning with descendLeft. We'll follow the discipline of separating the guard and action of each transition pred: pred descendLeft[pre, post: SearchState] { -- GUARD Search.target < pre.current.key some pre.current.left -- ACTION post.current = pre.current.left
} Because only the current node is a component of the search state, we only need to define the new current node in the action. Exercise: Write descendRight yourself. The structure should be very similar to descendLeft. Think, then click! You might write something like this: pred descendRight[pre, post: SearchState] { -- GUARD Search.target > pre.current.key some pre.current.right -- ACTION post.current = pre.current.right
} Let's do some basic validation: test expect { -- let's check that these two transitions are mutually-exclusive r_l_together: {some s: SearchState | {descendLeft[s] and descendRight[s]}} for 7 Node is unsat -- let's check that transitions are all possible to execute r_sat: {some s: SearchState | descendRight[s]} for 7 Node is sat l_sat: {some s: SearchState | descendLeft[s]} for 7 Node is sat -- initial state is satisfiable init_sat: {some s: SearchState | init[s]} for 7 Node is sat
} Now we'll combine these predicates into one that defines the entire recursive descent. The shape of this predicate is somewhat boilerplate; soon we'll see how to get rid of it entirely. For now, we'll just copy from the tic-tac-toe example and make small, local changes. Namely: we called the trace sig Search, not Game; we called the state sig SearchState, not Board; and we have two different transition predicates to include. pred traces { -- the graph is well-formed to begin with binary_tree -- The trace starts with an initial state init[Search.initialState] no sprev: SearchState | Search.nextState[sprev] = Search.initialState -- Every transition is a valid move all s: SearchState | some Search.nextState[s] implies { descendLeft [s, Search.nextState[s]] or descendRight[s, Search.nextState[s]] }
} Let's run it! run {traces} for exactly 7 Node, 5 SearchState for {nextState is plinear} The output may initially be overwhelming: by default, it will show all the atoms in the world and their relationships, including each SearchState. You could stay in the default visualizer and mitigate the problem a little by clicking on "Theme" and then "Add Projection" for SearchState. The problem is that this hides the current node indicator for the current state, since the current state becomes implicit. Instead, let's use a custom visualization. There are multiple options included with this book: bst.js , which visualizes the tree itself, without any regard to the descent. This is useful for debugging the basic tree model and the invariants themselves. bst_descent.js , which visualizes the descent in one picture. (Don't run this yet!) bst_temporal.js, which visualizes a Temporal Forge version of the model, which we'll get to soon. If we run bst_descent.js for this instance, it will draw the tree and highlight the path taken in the recursive descent. A node with the target key will have a thick border. A node that's visited in the descent will have a red border. So a correct descent should never show a node with a thick border that isn't red. TODO fill: how to run? Did we describe this already? This is easier to read, but also a little worrying: we see two nodes visited, and they aren't directly connected! Exercise: What's going on? (Hint: examine the table view. How many search states are there? Are they all in the trace?) Think, then click! The problem is that we allowed SearchState atoms to exist without being used in the trace. The visualizer script is highlighting a node that any SearchState uses. So we have two options: change the visualizer script to only look at states reachable from the first one; or add a constraint that forces all SearchState atoms to be used. We'll go for the second fix, adding this line to the traces predicate: -- All SearchStates are used
all s: SearchState | { s = Search.initialState or reachable[s, Search.initialState, Search.nextState]
} Ok, that's better, but we still aren't seeing a complete descent. To fix that, we'll say that, eventually, the descent either reaches bottom or a node with the target value: run { binary_tree traces some s: SearchState | s.current.key = Search.target or (no s.current.left and no s.current.right)
} for exactly 7 Node, 5 SearchState for {nextState is plinear} That's more like it. But what about the invariants? We only said binary_tree had to hold, which means that the tree being searched isn't necessarily a binary search tree yet.

109.body:
The syntax that you use in examples and to say is linear for a field (like you saw in the ripple-carry adder ) is more expressive than you've seen so far. Recall that Forge has two phases : deliniating the allowed search space, and solving the constraints within that search space. This new syntax lets you define a partial instance , which affects the first phase to limit the possible instances the solver will consider. You can even define a reusable partial instance using the inst command, and use it in the same place you'd use {next is linear} in a run, assert, etc. For example, we could pre-define the set of full adders in the ripple-carry adder model, giving each an atom name: inst fiveBits { FA = `FA0 + `FA1 + `FA2 + `FA3 + `FA4 + `FA5
} run {rca} for exactly 1 RCA for {fiveBits} Because this defines the set of FA atoms that must exist, it does something quite similar to just saying for exactly 5 FA. If we then add entries for the RCA's fields, we manually accomplish what nextAdder is linear would as well, while simultaneously making sure the first full adder in that ordering is what we see in RCA.firstAdder: inst fiveBits { RCA = `RCA0 FA = `FA0 + `FA1 + `FA2 + `FA3 + `FA4 + `FA5 -- Remember the back-tick mark here before atom names! `RCA0.firstAdder = `FA0 `RCA0.nextAdder = `FA0 -> `FA1 + `FA1 -> `FA2 + `FA2 -> `FA3 + `FA3 -> `FA4 + `FA4 -> `FA5
} run {rca} for exactly 1 RCA for {fiveBits} So far this is just a long-handed way of doing what we've already done. But partial instances are far more flexible. Remember the optimization we had to do in tic-tac-toe games , where we reduced the bitwidth from 4 to 3? Partial instances give us a much finer degree of control. Where for 3 Int still allows any integer between -4 and 3 to be used, we can use a partial instance to force well-formedness, before the solver ever sees a constraint: inst ttt_indexes { Board = `Board0 X = `X O = `O Player = X + O board in Board -> (0 + 1 + 2) -> (0 + 1 + 2) -> Player
} This says that any entry in any board's board field can only use the values 0 through 2, inclusive. It has an impact very similar to the wellformed pred we wrote, but can be much more efficient. (You'll learn more about why in the next chapter.) Exercise : Compare the statistical info for the original tic-tac-toe game run with and without this added partial instance information. Do you notice any changes? What do you think might be going on, here? Think, then click! The statistical information is reporting runtime, but also something else: the number of "clauses" and "variables". It turns out these express how big the boolean constraint problem is before the solver gets it. Partial instances can reduce these, and thus make the problem easier for the solver.

112.body:
Let's define some types for formulas. Like we've done before when defining a hierarchy of types, we'll make an abstract sig to represent the collection of all kinds of formulas, and have child sigs that represent specific kinds: -- Syntax: formulas
abstract sig Formula {}
sig Var extends Formula {} sig Not extends Formula {child: one Formula} sig Or extends Formula {o_left, o_right: one Formula}
sig And extends Formula {a_left, a_right: one Formula}
-- If we really wanted to, we could add `Implies`, `IFF`, etc. in the same way. Field names Forge doesn't allow re-use of field names between sigs. If you try, you'll get an error that says the name is already used. So we need to name the left and right children of the And and Or types differently. Hence the o_ and a_ prefixes.

113.body:
As always, we need a notion of wellformedness. What would make a formula tree "garbage"? Well, if the syntax tree contained a cycle, the tree wouldn't be a tree, and the formula wouldn't be a formula! We'll write a wellformed predicate where an assertion like this will pass: pred trivialLeftCycle { some a: And | a.a_left = a
}
pred notWellformed { not wellformed }
assert trivialLeftCycle is sufficient for notWellformed (TODO: I don't like the need to create a secondary helper notWellformed. Discuss with SP.) Like in binary trees, there are multiple fields that a cycle could use. Then, we only needed to worry about left and right; here there are many more. Let's build a helper predicate that evaluates whether a formula is a smaller part of another: -- IMPORTANT: remember to update this if adding new formula types!
pred subFormulaOf[sub: Formula, f: Formula] { reachable[sub, f, child, a_left, o_left, a_right, o_right]
} At first, this might seem like a strange use of a helper. There's just one line, and all it does is call the reachable built-in predicate. However, we probably need to check for subformulas in multiple places in our model. And, we might anticipate a need to add more formula types (maybe we get around to adding Implies). Then we need to remember to add the fields of the new sig everywhere that reachable is used. And if we leave one out, we probably won't get an error. So making this helper is just good engineering practice; this way, we minimize the number of places that need the change. pred wellformed { -- no cycles all f: Formula | not subFormulaOf[f, f]
} Remember what wellformed is for Recall that we use wellformed to exclude "garbage" instances only, analogously to filtering an input generator in property-based testing. The stuff we might want to verify (or build a system to enforce) goes elsewhere—or else Forge will exclude any potental counterexamples. We'll want to add wellformed to the first example we wrote, but it should still pass. Let's run the model and look at some formulas! We could just run {wellformed}, but that might be prone to giving uninteresting examples. Let's try identifying the root node in our run constraint, which would let us ask for something more complex: run { wellformed some top: Formula | { all other: Formula | top != other => { subFormulaOf[other, top] } }
} for exactly 8 Formula Try running this. You should see some example formula trees; we've modeled the syntax of boolean logic. Exercise: Write at least one more positive and one more negative test for wellformed in this model. Exercise: Why didn't we add a constraint to prevent nodes from having multiple parents? That is, why didn't we prevent an instance like this? (And, in light of that, is it really fair to call these "trees"?) TODO: add image Think, then click! If we wanted to exlude "sharing" of child formulas, we'd need to allow multiple nodes to have the same meaning. E.g., if we had a variable x, we'd need to allow multiple Var atoms to represent x, which would greatly complicated the model and increase the size of its instances. Instead, we let one Var atom be re-used in multiple contexts. So, while the instances aren't (strictly speaking) trees, they represent trees in an efficient way.

