If we don't know the meaning of that if statement and the and within it, we don't actually know what will happen! Syntax can mislead us, especially if we have pre-existing intuitions. And if we want to reason about what a piece of syntax does , we need to understand what the syntax means . Right now we're modeling boolean formulas. So let's understand the meaning of formulas; sometimes this is called their semantics . Exercise: What can I do with a formula? What kind of operations is it meant to enable? Think, then click! If I have a formula, I can plug in various values into its variables and read off the result: does the overall formula evaluate to true or false when given those values? This is what we want to encode in our model. Let's think of a boolean formula like a function from sets of variable values to a result boolean . We'll need a way to represent "sets of variable values". Sometimes these are called a "valuation", so let's make a new sig for that. sig Valuation { -- [HELP: what do we put here? Read on...]
} We have to decide what fields a Valuation should have. Once we do that, we might start out by writing a recursive predicate or function, kind of like this pseudocode: pred semantics[f: Formula, val: Valuation] { f instanceof Var => val sets the f var true f instanceof And => semantics[f.a_left, val] and semantics[f.a_right, val] ...
} This won't work! Forge is not a recursive language; you won't be able to write a predicate that calls itself like this. So we've got to do something different. Let's move the recursion into the model itself, by adding a mock-boolean sig: one sig Yes {} and then adding a new field to our Formula sig (which we will, shortly, constrain to encode the semantics of formulas): satisfiedBy: pfunc Valuation -> Yes This works but it's a bit verbose and quite tangled. It'd be more clear to just say that every formula has a set of valuations that satisfy it. But so far we haven't been able to do that. Language change! First, let's change our language to #lang forge. This gives us a language with more expressive power, but also some subtleties we'll need to address. Relational Forge This language is called Relational Forge , for reasons that will become apparent. For now, when you see #lang forge rather than #lang froglet, expect us to say "relational", and understand there's more expressivity there than Froglet gives you. Now, we can write that every formula is satisfied by some set of valuations: abstract sig Formula { -- Work around the lack of recursion by reifying satisfiability into a field. -- f.satisfiedBy contains an instance IFF that instance makes f true. -- [NEW] Relational Forge lets us create fields that contain _sets_ of values. satisfiedBy: set Valuation
} We can now infer what field(s) Valuation should have. A Valuation isn't a formula, so it won't have a satisfiedBy field, but it does need to contain something. Exercise: What does a Valuation contain, and how does that translate to its field(s) in Forge? Think, then click! sig Valuation { trueVars: set Var
} Now we can encode the meaning of each formula as a predicate like this: -- IMPORTANT: remember to update this if adding new fmla types!
-- Beware using this fake-recursion trick in general cases (e.g., graphs with cycles)
-- It's safe to use here because the data are tree shaped. pred semantics
{ -- [NEW] set difference all f: Not | f.satisfiedBy = Valuation - f.child.satisfiedBy -- [NEW] set comprehension, membership all f: Var | f.satisfiedBy = {i: Valuation | f in i.trueVars} -- ...
} Exercise: We still need to say what f.satisfiedBy is for Or and And formulas. What should it be? (You might not yet know how to express it in Forge, but what should satisfy them, conceptually? Hint: think in terms of what satisfies their left and right subformulas.) Think, then click! We'd like Or to be satisfied when either of its children is satisfied. In contrast, And requires both of its children to be satisfied. We'll use union (+) and intersection (&) for this. pred semantics
{ -- [NEW] set difference all f: Not | f.satisfiedBy = Valuation - f.child.satisfiedBy -- [NEW] set comprehension, membership all f: Var | f.satisfiedBy = {i: Valuation | f in i.trueVars} -- [NEW] set union all f: Or | f.satisfiedBy = f.o_left.satisfiedBy + f.o_right.satisfiedBy -- [NEW] set intersection all f: And | f.satisfiedBy = f.a_left.satisfiedBy & f.a_right.satisfiedBy
} In hindsight: yes, this is why you can't use + for integer addition in Froglet; we reserve the + operator to mean set union.

