-- What are some properties we'd like to check? -- We already know a double-negation is possible, so let's write a predicate for it
-- and use it in an assertion. Since it's satisfiable (above) we need not worry -- about vacuous truth for this assertion.
pred isDoubleNegationWF[f: Formula] { f in Not -- this is a Not f.child in Not -- that is a double negation wellformed
} pred equivalent[f1, f2: Formula] { -- Note that this predicate is always with respect to scopes/bounds. That is, "equivalent" -- here isn't real logical equivalence, but rather whether there is a Valuation in a given -- instance on which the two formulas disagree. f1.satisfiedBy = f2.satisfiedBy
} assert all n: Not | isDoubleNegationWF[n] is sufficient for equivalent[n, n.child.child] for 5 Formula, 4 Valuation is unsat -- de Morgan's law says that -- !(x and y) is equivalent to (!x or !y) and vice versa. Let's check it. -- First, we'll set up a general scenario with constraints. pred negatedAnd_orOfNotsWF[f1, f2: Formula] { wellformed -- f1 is !(x and y) f1 in Not f1.child in And -- f2 is (!x or !y) f2 in Or f2.o_left in Not f2.o_right in Not f2.o_left.child = f1.child.a_left f2.o_right.child = f1.child.a_right } assert all f1, f2: Formula | negatedAnd_orOfNotsWF[f1, f2] is sufficient for equivalent[f1, f2] for 8 Formula, 4 Valuation is unsat -- If we're going to trust that assertion passing, we need to confirm -- that the left-hand-side is satisfiable! test expect { negatedAnd_orOfNotsWF_sat: { some f1, f2: Formula | negatedAnd_orOfNotsWF[f1, f2] } for 8 Formula, 4 Valuation is sat
}

121.body:
Consider this small Relational Forge model : #lang forge
sig Person { friends: set Person, followers: set Person
}
one sig Nim, Tim extends Person {} pred wellformed { -- friends is symmetric (followers might not be) all disj p1, p2: Person | p1 in p2.friends implies p2 in p1.friends -- you cannot follow or friend yourself all p: Person | p not in p.friends and p not in p.followers
}
run {wellformed} for exactly 8 Person Let's run it, get a reasonably large instance, and try to figure out how to express some goals in the evaluator. EXERCISE : You'll be following along with each of these questions. Use the evaluator heavily---it's great for figuring out what different expressions evaluate to. Expression: Nim's followers Think, then click! This is just Nim.followers. Formula: Nim is reachable from Tim via "followers" Think, then click! We can use the reachable built-in: reachable[Nim, Tim, followers]. Expression: Nim's followers' followers Think, then click! Another application of the field! Nim.followers.followers. But wait, what does this really mean? Since Nim.followers is a set, rather than a Person, should I be able to apply .followers to it? If we try this in the evaluator, it works, but we're no longer just doing a "field access"; something more must be going on. Formula: Nim is reachable from Tim via the inverse of "followers" (what we might call "following")? Think, then click! Hmm. This seems harder. We don't have a field called following, and the reachable built-in takes fields! ...it does take fields, right? Or might it take something more flexible? Can we use set operations to adjust the potential edges that reachable looks at? To figure that out, let's try something else. Formula: Nim is reachable from Tim via followers, but not including Tim's friends? Think, then click! We might try reachable[Nim, Tim, (followers-Tim.friends)] but this will produce an error. Why? Well, one reason we might give is: ...because followers is a field but Tim.friends is a set. But is that the real answer? The error complains about "arity": 2 vs 1. Let's type those two expressions into the evaluator and see what we get. For followers, we get a set of pairs of people. But Tim.friends is a set of singletons . Arity, Relations, and Tuples Arity is another word for how wide the elements of a set are. Here, we'd say that followers has arity 2 since elements of followers are pairs of atoms. Similarly, Tim.friends has arity 1 since its elements are singletons. So Forge is pointing out that taking the set difference of these two makes no sense; their elements are shaped differently. When we're talking about sets in this way, we sometimes call them relations . E.g., the followers field is a binary relation because it has arity 2. We'll call elements of relations tuples . E.g., if Nim follows Tim, the tuple (Tim, Nim) would be present in followers. In Relational Forge, reachable doesn't take "fields"; it takes relations. Specifically, binary relations, which define the steps it can use to connect the two objects. That's the fact we'll use to solve the 2 problems above. (Attempt 2) Formula: Nim is reachable from Tim via the inverse of "followers" (what we might call "following")? Now that we know followers is a binary relation, we can imagine flipping it to get its inverse. How can we do that? Well, there are multiple ways! We could write a set-comprehension: {p1, p2: Person | p1 in p2.followers} The order matters here! If p1 is in p2.followers, then there is an entry in the relation that looks like (p2, p1). We could make this more explicit by writing: {p1, p2: Person | p2->p1 in followers} Now that we know followers is a set, this makes sense! The product (->) operator combines p2 and p1 into a binary tuple, which may (or may not) be in followers. Forge provides an operator that does this directly for binary relations: transpose (~). So we could write instead: ~followers Which should you use? It's up to you! Regardless, we could now answer this question with: reachable[Nim, Tim, ~followers] (Attempt 2) Formula: Nim is reachable from Tim via followers, but not including Tim's friends? Everything is a set, so let's build the subset of followers that doesn't involve anyone in Tim.friends. We can't write followers-(Tim.friends), since that's an arity mismatch. Somehow, we need to remove entries in followers involving one of Tim's friends and anybody else . One way is to use the product operator to build the binary relation we want reachable to use. E.g.: reachable[Nim, Tim, followers-(Tim.friends->Person)] You may notice that we've now used -> in what seems like 2 different ways. We used it to combine specific people, p1 and p2 above into a single tuple. But now we're using it to combine two sets into a set of tuples. This flexibility is a side effect of sets being the fundamental concept in Relational Forge: the product of ((Tim)) and ((Nim)) is ((Tim, Nim)); the product of ((Person1), (Person2)) and ((Person3), (Person4)) is ((Person1, Person3), (Person1, Person4), (Person2, Person3), (Person2, Person4)). Formally, -> is the cross-product operation on sets. You'll see this apparently double-meaning when using in and =, too: singletons are single-element sets, where the element is a one-column tuple.

126.body:
Let's start with a simple model. We'll critique this model as the semester progresses, but this will be useful enough to get us started. abstract sig Location {}
one sig Uninterested, Waiting, InCS extends Location {} abstract sig Process {}
one sig ProcessA, ProcessB extends Process {} sig State { loc: func Process -> Location, flags: set Process
} An initial state is one where all processes are uninterested, and no process has raised its flag: pred init[s: State] { all p: Process | s.loc[p] = Uninterested no s.flags } We then have three different transition predicates, each corresponding to one of the lines of code above, and a transition predicate delta that represents any currently-possible transition: pred raise[pre: State, p: Process, post: State] { pre.loc[p] = Uninterested post.loc[p] = Waiting post.flags = pre.flags + p all p2: Process - p | post.loc[p2] = pre.loc[p2]
} pred enter[pre: State, p: Process, post: State] { pre.loc[p] = Waiting pre.flags in p -- no other processes have their flag raised post.loc[p] = InCS post.flags = pre.flags all p2: Process - p | post.loc[p2] = pre.loc[p2]
} pred leave[pre: State, p: Process, post: State] { pre.loc[p] = InCS post.loc[p] = Uninterested post.flags = pre.flags - p all p2: Process - p | post.loc[p2] = pre.loc[p2]
} -- the keyword "transition" is reserved
pred delta[pre: State, post: State] { some p: Process | raise[pre, p, post] or enter[pre, p, post] or leave[pre, p, post]
} We won't create a Trace sig or traces predicate at all, because we're going to apply induction rather than trace generation.

