Before we run Forge, ask yourself whether the algorithm above guarantees mutual exclusion. (It certainly has another kind of error, but we'll get to that later. Focus on this one property for now.) It seems reasonable that the property holds. But if we try to use the inductive approach to prove that: pred good[s: State] { #{p: Process | s.loc[p] = InCS} <= 1
} pred startGoodTransition[s1, s2: State] { good[s1] delta[s1,s2]
}
assert all s: State | init[s] is sufficient for good[s] for exactly 1 State
assert all pre, post: State | startGoodTransition[pre, post] is sufficient for good[post] for exactly 2 State The inductive case fails . Let's see what the counterexample is: run { not { all pre, post: State | delta[pre, post] and good[pre] implies good[post] } } for exactly 2 State Yields, in the table view: Notice that neither process has raised its flag in either state. This seems suspicious, and might remind you of the binary-search model, where the good predicate wasn't strong enough to be inductive, but the counterexample Forge found wasn't actually reachable. This is another such situation.

140.body:
Consider this Forge model and corresponding run command: abstract sig Person { followers: set Person
}
one sig Alice, Bob, Charlie extends Person {}
run {some followers} for exactly 3 Person How many potential instances are there? Note that there can only ever be exactly 3 people, since Person is abstract. Think, then click! There are always exactly 3 people, and the only relation that can vary is followers, which has 2 columns. That means 32=9 potential pairs of people, and the field contains a set of those. The set either contains or does not contain each pair. So there are 29=512 potential instances. Notice how we reached that number. There are 9 potential pairs of people. 9 potential follower relationships. 9 essential things that may, or may not, be the case in the world. Nothing else. If you run Forge on this model, you'll see statistics like these: #vars: (size-variables 10); #primary: (size-primary 9); #clauses: (size-clauses 2)
Transl (ms): (time-translation 122); Solving (ms): (time-solving 1) The timing may vary, but the other stats will be the same. The thing to focus on is: 9 primary variables. Primary variables correspond to these atomic truths, which in this case is just who follows who in our fixed 3-person world: the number of rows that are potentially in the followers relation. Let's try increasing the size of the world: run {some followers} for 4 Person Now we have a 4th person---or rather, we might have a 4th person. When we run, Forge shows: #vars: (size-variables 27); #primary: (size-primary 17); #clauses: (size-clauses 18) We've gone from 9 to 17 primary variables. Why? Think, then click! There is another potential Person in the world; the world may be either size 3 or 4. Whether or not this fourth person exists is 1 new Boolean variable. And since there are 4 potential people in the world, there are now 42=16 potential follower relationships. This equals 17 variables. This is how Forge translates statements about atoms into statements about booleans.

144.body:
Let's return to the original Followers model: abstract sig Person { followers: set Person
}
one sig Alice, Bob, Charlie extends Person {}
run {some followers} for exactly 3 Person We decided it probably had 512 instances. But does it really ? Let's hit Next a few times, and count! Actually, that sounds like a lot of work. Let's simplify things a bit more, instead: abstract sig Person { follower: one Person -- changed: replace `set` with `one` }
one sig Alice, Bob, Charlie extends Person {}
run {} for exactly 3 Person -- changed: don't run any predicates Now everybody has exactly one follower. There are still 9 potential tuples, but we're no longer storing sets of them for each Person. Put another way, every instance corresponds to an ordered triplet of Person objects (Alice's follower, Bob's follower, and Charlie's follower). There will be 3×3×3=33=27 instances. And indeed, if we click "Next" 26 times, this is what we see. (Whew.) Now suppose we didn't name the 3 people, but just had 3 anonymous Person objects: sig Person { follower: one Person
}
run {} for exactly 3 Person -- changed: no named people The math is still the same: 27 instances. But now we only get 9 before hitting the unsat indicator of "no more instances" in the visualizer. What's going on? Forge tries to avoid showing you the same instance multiple times. And, if objects are un-named and the constraints can never distinguish them, instances will be considered "the same" if you can arrive at one by renaming elements of the other. E.g., Person1 follows Person2
Person2 follows Person3
Person3 follows Person1 would be considered equivalent to: Person2 follows Person1
Person3 follows Person2
Person1 follows Person3 since the individual Person atoms are anonymous to the constraints, which cannot refer to atoms by name. We call these instances isomorphic to each other, and say that there is a symmetry between them. Formally, Forge finds every instance "up to isomorphism". This is useful for: increasing the quality of information you get from paging through instances; and (sometimes) improving the runtime on problems, especally if solutions are very rare. This process isn't always perfect: some equivalent instances can sneak in. Removing all equivalent instances turns out to sometimes be even more expensive than solving the problem. So Forge provides a best-effort, low cost attempt based on a budget for adding additional constraints to the problem, specifically to eliminate symmetries. You can adjust the budget for symmetry breaking via an option: option sb 0 turns off symmetry breaking; and option sb 20 is the default. If we turn off symmetry-breaking, we'll get the expected number of instances in the above run: 27. Symmetry Breaking != Filtering Forge doesn't just filter instances after they're generated; it adds extra constraints that try to rule out symmetric instances. These constraints are guaranteed to be satisfied by at least one element of every equivalence class of instances. There's a lot of research work on this area, e.g., this paper from 2020.

