This part of the notes is meant to reinforce what we'd previously done with relational join in Forge. We'll cover some of this in class, but the rest is here for your reference. Let's go back to the directed-graph model we used before: #lang forge
sig Person { friends: set Person, followers: set Person
}
one sig Nim, Tim extends Person {}
