}
run {wellformed} for exactly 5 Person pred reachableIn1To7Hops[to: Person, from: Person, fld: Person->Person] { to in from.fld or to in from.fld.fld or to in from.fld.fld.fld or to in from.fld.fld.fld.fld or to in from.fld.fld.fld.fld.fld or to in from.fld.fld.fld.fld.fld.fld or to in from.fld.fld.fld.fld.fld.fld.fld -- ... and so on, for any finite number of hops -- this is what you use the transitive-closure operator (^) -- or the reachable built-in predicate for.
