We'll add the same finite-trace infrastructure as before. This time we're able to use full Forge, so we can use the transpose (~) operator to say that the initial state has no predecessors. one sig Trace { initialState: one State, nextState: pfunc State -> State
} pred trace { no Trace.initialState.~(Trace.nextState) init[Trace.initialState] all s: State | some Trace.nextState[s] implies { delta[s, Trace.nextState[s]]
}
pred lasso { trace all s: State | some Trace.nextState[s]
} Let's test our lasso predicate to make sure it's satisfiable. And, because we're careful, let's make sure it's not satisfiable if we don't give the trace enough states to loop back on itself: test expect { lassoVacuity: { lasso } is sat lassoVacuityNotEnough: { lasso } for 2 State is unsat
}

155.body:
If we know that the trace is a lasso, we can write a predicate that identifies some process being starved. This isn't easy, though. To see why, look at this initial attempt, which says that our property fails if ProcessA never enters the critical section: pred badLasso { lasso all s: State | s.loc[ProcessA] != InCS
}
test expect { checkNoStarvation: { badLasso } is unsat
} This is unsatisfiable ; the test passes. Could anything potentially be going wrong in our model, though? We might first wonder, as we usually should, whether the test allocates enough states to reasonably find a counterexample. We've got 8 reachable states, so maybe we'd need 8 (or 9?) states in the test. That's true! There's something else wrong here, and it's more subtle. We'll need to address both of these problems to make progress. Exercise: What else is wrong? Think, then click! The badLasso predicate wouldn't hold true if the system allowed ProcessA to enter the critical section once (and only once). We want ProcessA to be able to get access (eventually) whenever it needs that access. That is, we need to say that the loop of the lasso contains no states where ProcessA is in the critical section, no matter what happens before the cycle starts. That sounds like a lot of work: we'd need to identify the sub-sequence of states representing the cycle and properly apply the constraint to only those states. More importantly, it sounds really easy to get this wrong if we write it ourselves, at this low level of abstraction, because the specifics might change as the model evolves. There's a better way. Forge has another language level—Temporal forge—that provides all of this automatically.

157.body:
Here's a quick example that motivates how Temporal Forge works, and some pitfalls that can occur when you use it. Suppose that we're modeling a system with a single integer counter: #lang forge/temporal -- enable traces of up to length 10
option max_tracelength 10 one sig Counter { -- The value of the "counter" field may vary over time. var counter: one Int
} run { -- Temporal-mode formulas are interpreted from an implicit current time. By default, -- we're talking about the start of the trace. So, the counter starts at 0. Counter.counter = 0 -- `always` means "now and at every time in the future". The prime (') operator -- says "value in the next state". So this means that the counter is incremented -- with every transition: always Counter.counter' = add[Counter.counter, 1]
} for 3 Int First, notice that we didn't need to define the structure of a trace. We got that for free by using Temporal Forge, which only ever finds traces. Second, this is satisfiable , as we might expect. But what happens if you change the bound on Int to for 4 Int? Exercise: Try it. What happens? Why do you think it did happen? Think, then click! It's unsatisfiable with the new bound. This is strange: usually when we increase the scope on a sig, without using the exactly keyword, we only ever make something satisfiable (because we're increasing the possible sizes of instance that Forge checks). The problem is that, because only lasso traces are found , Forge can only satisfy this model by exploiting integer overflow. At 3 Int, which supports values between -4 and 3, the counter progresses like this: 0, 1, 2, 3, (overflow to) -4, -3, -2, -1, 0 and so on. We have 10 states to work with, which is enough to wrap around back to 0. In contrast, at 4 Int, the values range from -8 to 7. Overflow will happen as normal, but only when moving from 7 to -8. The 10 states we have won't be enough to actually loop back around to 0—and there must be a loop somewhere in a lasso trace. So Temporal Forge says that the model is unsatisfiable at trace length 10, for 4 Int.

158.body:
Let's convert the mutual-exclusion model into Temporal Forge. We'll add the necessary options first: #lang forge/temporal option max_tracelength 10 Option Names Be sure to include the underscore! Misspellings like maxtracelength aren't a valid option name. Now we'll update the data definitions. Because both the flags and loc fields change over time, we'll make both of them var: TODO: double-check; is World new? If so, explain. one sig World { var loc: func Thread -> Location, var flags: set Thread At any moment in time, every thread is in exactly one location. And, at any moment in time, each thread has either raised or lowered its flag. Now for the predicates. In Temporal Forge, we don't have the ability to talk about specific pre- and post-states: the language handles the structure of traces for us. This means we have to change the types of our predicates. For init, we have: -- No argument! Temporal mode is implicitly aware of time
pred init { all p: Process | World.loc[p] = Uninterested no World.flags } The loss of a State sig is perhaps disorienting. How does Forge evaluate init without knowing which state we're looking at? In Temporal Forge, every constraint is evaluated not just in an instance, but in that instance at some moment in time . You don't need to explicitly mention the moment. So the formula no World.flags is true exactly when, at the current time, there's no flags raised. Using init is like saying "are we in an initial state right now ?" Similarly, we'll need to change our transition predicates: -- Only one argument; same reason as above
pred raise[p: Process] { // pre.loc[p] = Uninterested // post.loc[p] = Waiting // post.flags = pre.flags + p // all p2: Process - p | post.loc[p2] = pre.loc[p2] // GUARD World.loc[p] = Uninterested // ACTION World.loc'[p] = Waiting World.flags' = World.flags + p all p2: Process - p | World.loc'[p2] = World.loc[p2]
} I've left the old version commented out so you can contrast the two. Again, the predicate is true subject to an implicit moment in time. The priming (') operator means "this expression in the next state" ; so if raise holds at some point in time, it means there is a specific relationship between the current and next moments. We'll convert the other predicates similarly, and then run the model: run { -- start in an initial state init -- in every state of the lasso, the next state is defined by the transition predicate always {some t: Thread | raise[t] or enter[t] or leave[t]}
} This is the general shape of things! There are still some potential problems remaining, but we'll get to them shortly. First, we need to talk about how to view a Temporal Forge instance.

169.body:
We could prevent this issue by allowing a doNothing transition from every state. Then from Forge's perspective there's no "deadlock", and a lasso trace can be found. We can add such a transition easily enough: pred doNothing { flags' = flags loc' = loc
}
run { init always { (some p: Process | {raise[p] or enter[p] or leave[p]}) or doNothing }
} But we have to do so carefully, or the fix will cause new problems. If we allow a doNothing transition to happen anywhere , then Forge can find traces when nothing ever happens. In that case, our liveness property is definitely going to fail, even if we were modeling a smarter algorithm. So we need to reduce the power of doNothing somehow. Put another way: we started with an overconstraint bug: if only lassos can be found, then we can't find a trace exhibiting deadlock. Adding a powerful doNothing fixes the overconstraint but adds a new underconstraint , because we'll get a lot of garbage traces where the system can just pause arbitrarily (while the trace continues). We saw this phenomenon earlier when we were modeling tic-tac-toe games , and wanted to work around the fact that the is linear annotation forces exact bounds. We can use the same ideas in the fix here.

170.body:
Let's look at one of our transitions: pred raise[p: Process] { // GUARD World.loc[p] = Disinterested // ACTION World.loc'[p] = Waiting World.flags' = World.flags + p all p2: Process - p | World.loc'[p2] = World.loc[p2]
} Notice it's split into a "guard" and an "action". If all the constraints in the guard are true, the transition can occur. Formally, we say that if all the guard constraints hold, then the transition is enabled . When should doNothing be enabled? When no other transition is. What if we made an "enabled" predicate for each of our other transitions? Then we could write: pred doNothing { -- GUARD (nothing else can happen) not (some p: Process | enabledRaise[p]) not (some p: Process | enabledEnter[p]) not (some p: Process | enabledLeave[p]) -- ACTION (no effect) flags' = flags loc' = loc
} We won't create a separate enabledDoNothing predicate. But we will add doNothing to the set of possible moves: always { (some p: Process | {raise[p] or enter[p] or leave[p]}) or doNothing } And we'd also better create those 3 enabled predicates, too. ( TODO: link code ) But then, finally, we can write a check looking for deadlocks: test expect { noDeadlocks_counterexample: { -- setup conditions init always { (some p: Process | {raise[p] or enter[p] or leave[p]}) or doNothing } -- violation of the property not always { some p: Process | enabledRaise[p] or enabledEnter[p] or enabledLeave[p] } } is sat
} which fails. Why? The counterexample (at least, the one I got) is 3 states long. And in the final state, both processes are Waiting. Success! Or, at least, success in finding the deadlock . But how should we fix the algorithm? And how can we avoid confusion like this in the future?

176.body:
Our little algorithm is 90% of the way to a working mutex called the Peterson lock . The Peterson lock just adds one extra bit of state, and one transition to set that bit. In short, if our current algorithm is analogous to raising hands for access, the other bit added is like a "no, you first" when two people are trying to get through the door at the same time; that's exactly the sort of situation our both-flags-raised deadlock represented. TODO: add transition diagram here, and probably for lock1 To represent which process (if any) has most recently said "no, you go first", we'll add a polite: lone Process field to each Process. The algorithm now needs to take a step to set this value. It goes something like this (in pseudocode) after the process becomes interested: // location: uninterested this.flag = true
// location: halfway (NEW)
polite = me // location: waiting while(other.flag == true || polite == me) {} // hold until their flag is lowered _or_ the other is being polite
// location: in CS run_critical_section_code(); // don't care details
this.flag = false Because we're modeling individual operations executing, we'll need to add a new location to the state, which I'll call Halfway. We'll also need a new transition (and to change existing transitions in some places). The new transition might look something like this: pred enabledNoYou[p: Process] { World.loc[p] = Halfway
}
pred noYou[p: Process] { -- GUARD enabledNoYou[p] -- ACTION World.loc'[p] = Waiting World.flags' = World.flags World.polite' = p all p2: Process - p | World.loc'[p2] = World.loc[p2]
} We'll need a small edit in raise, to set World.loc'[p] = Halfway instead of World.loc'[p] = Waiting and a modification to the enter transition so that it's enabled if either nobody else has their flag raised or the current process isn't the one being polite anymore: pred enabledEnter[p: Process] { World.loc[p] = Waiting -- no other processes have their flag raised *OR* this process isn't the polite one (World.flags in p or World.polite != p)
} Then we add the new transition to the overall transition predicate, to doNothing, to the deadlock check test—anywhere we previously enumerated possible transitions. We also need to expand the frame conditions of all other transitions to keep polite constant if we aren't explicitly modifying it. Watch out! Beware of forgetting (or accidentally including) primes. This can lead to unsatisfiable results, since the constraints won't do what you expect between states. E.g., an accidental double-prime will mean "in the state after next".

187.body:
A server can have one of three different roles. These are called "states" in the paper, but I find that a confusing term given just how many kinds of state there are here: #lang forge/temporal abstract sig Role {}
one sig Follower, Candidate, Leader extends Role {} Every Server has exactly one role at any time. All servers begin as Followers at startup. We'll express these facts as a sig definition and an initial-state pred, and add to both as we continue. sig Server { var role: one Role
}
/** The initial startup state for the cluster */
pred init { all s: Server | { s.role = Follower } }

188.body:
If a Follower hasn't heard from the leader recently (either via a state-update message or a heartbeat message), it will become a Candidate. In an actual implementation, "recently" would be concretely defined by a timeout value, but we'll try to avoid that here. The paper says: To begin an election, a follower increments its current term and transitions to candidate state. It then votes for itself and issues RequestVote RPCs in parallel to each of the other servers in the cluster. A candidate continues in this state until one of three things happens: (a) it wins the election, (b) another server establishes itself as leader, or (c) a period of time goes by with no winner. And from Section 5.4.1, the voter denies its vote if its own log is more up-to-date than that of the candidate. So we'll need to keep track of a server's current vote and enable it to send requests for votes. We'll also need to recognize the end of the election in these three different ways—we might start with just a single transition that incorporates all three, and expand it only if we need to. We'll omit modeling logs for the moment, but leave in a note so we don't forget. Be guided by the writeup! I'll be guided by Figure 2 in the Raft paper, which gives field names and initial values for variables. E.g., it says that every server has a votedFor variable which starts out null. sig Server { var role: one Role, var votedFor: lone Server, -- NEW var currentTerm: one Int -- NEW
}
/** The initial startup state for the cluster */
pred init { all s: Server | { s.role = Follower no s.votedFor -- NEW s.currentTerm = 0 -- NEW } } Now let's create some abstract transitions. Starting an Election A Follower runs for leader if it hasn't heard from Leader node in some time. We haven't yet modeled message passing, and we really hope not to have to model time. But we can at least require the server be a Follower when it begins. /** Server `s` runs for election. */
pred startElection[s: Server] { s.role = Follower -- GUARD s.role' = Candidate -- ACTION: in candidate role now s.votedFor' = s -- ACTION: votes for itself s.currentTerm' = add[s.currentTerm, 1] -- ACTION: increments term -- ACTION: issues RequestVote calls -- ... we can't model this yet: no message passing -- FRAME: role, currentTerm, votedFor for all other servers all other: Server - s | { other.votedFor' = other.votedFor other.currentTerm' = other.currentTerm other.role' = other.role }
}``` Ok, so should we immediately rush off to model message passing? I don't think so, we'd like to focus on the essence of leader election. So, instead, we'll have a transition that represents another server receiving that voting request, but guard it differently: ```forge
/** A server can vote for another server on request, "on a first-come-first-served basis". */
pred makeVote[voter: Server, c: Server] { no voter.votedFor -- GUARD: has not yet voted c.role = Candidate -- GUARD: election is running noLessUpToDateThan[c, voter] -- GUARD: candidate is no less updated voter.votedFor' = c -- ACTION: vote for c -- FRAME role, currentTerm for voter -- FRAME: role, currentTerm, votedFor for all others all s: Server | { s.role' = s.role s.currentTerm' = s.currentTerm (s != voter) => (s.votedFor' = s.votedFor) }
} /** Does the first server have a log that is no less up-to-date than the second server? */
pred noLessUpToDateThan[moreOrSame: Server, baseline: Server] { -- true (for now) -- TODO: once we model logs, the paper describes this relation as: -- the log with the later term is more up-to-date. -- if the logs end with the same term, then the longer log is more up-to-date.
} Leaders shouldn't be able to vote. Oops. I forgot a guard constraint that seems important: I'll just add: voter in Follower + Candidate in order to allow the vote to occur only if the voter is not a Leader already. Ending an Election A candidate wins an election if it receives votes from a majority of the servers in the full cluster for the same term. Once a candidate wins an election, it becomes leader. It then sends heartbeat messages to all of the other servers to establish its authority and prevent new elections. /** Server `s` is supported by a majority of the cluster.*/
pred majorityVotes[s: Server] { #{voter: Server | voter.votedFor = s} > divide[#Server, 2]
}
/** Server `s` wins the election. */
pred winElection[s: Server] { -- GUARD: won the majority majorityVotes[s] -- ACTION: become leader, send heartbeat messages s.role' = Leader s.currentTerm' = s.currentTerm no s.votedFor' -- TODO: heartbeats -- For now, we'll just advance their terms and cancel votes -- directly as a FRAME, rather than using the network all f: Server - s | { f.role' = Follower no f.votedFor' f.currentTerm' = add[f.currentTerm, 1] }
} if many followers become candidates at the same time, votes could be split so that no candidate obtains a majority. When this happens, each candidate will time out and start a new election by incrementing its term and initiating another round of RequestVote RPCs. Random timeouts Raft uses random timeouts to reduce the chances of a failed election. If elections fail over and over again, the cluster is stalled. We won't model this, but may have to add some assumptions later on. /** Nobody has won the election after some time. */
pred haltElection { -- GUARD: there is some Candidate -- i.e., there is an election running some s: Server | s.role = Candidate -- GUARD: no server with the Candidate role has received a majority vote. -- (There is no requirement that everyone has voted; indeed, that wouldn't -- work since the network might be broken, etc.) no s: Server | s.role = Candidate and majorityVotes[s] -- ACTION: each Candidate (not each server, necessarily) will increment their term -- and clear their vote. all c: Server | { c.role = Candidate => c.currentTerm' = add[c.currentTerm, 1] else c.currentTerm' = c.currentTerm no c.votedFor' } -- ACTION: initiating another round of RequestVote -- ... we can't model this yet: no message passing -- FRAME: nobody's role changes all c: Server | c.role' = c.role
} Whew! That's a lot of constraints without ever running the model. We should do that next. Running the Model First, let's check in. What have we even accomplished? We've forced ourselves to enumerate the sentences from the paper "in our own words" (and better, in less ambiguous language); We've probably prompted ourselves to ask questions that we wouldn't just from reading the paper. For example, when I went through the predicates above, I had originally read the paper as saying "each server will time out and start a new election", not "each candidate ". Writing it down made me notice my misunderstanding. We've made a start at our formal model, and we can even run it. That we haven't modeled the "whole protocol" is not a concern at this point. We make incremental progress, which is the only way to make progress on a large model. Because this is only one part of the overall model we want to build, we'll allow unguarded no-op transitions in our trace predicate. This will make it easier to spot some classes of bugs, and (soon) help compose different modules as we write them. /** Guardless no-op */
pred election_doNothing { -- ACTION: no change role' = role votedFor' = votedFor currentTerm' = currentTerm
} /** Allow arbitrary no-op ("stutter") transitions, a la TLA+. We'll either assert fairness, or use some other means to avoid useless traces. */ pred electionSystemTrace { init always { (some s: Server | startElection[s]) or (some s, c: Server | makeVote[s, c]) or (some s: Server | winElection[s]) or (haltElection) or (election_doNothing) }
} run { electionSystemTrace eventually {some s: Server | winElection[s]} #Server > 1
} Let's see what we get. The minimap shows a lasso trace of 4 states: Here's what we see in the default visualization: State0 The initial state: both servers are followers with current term 0. State1 One server initiates an election, voting for themselves and advancing their term. State2 The other server votes for the candidate. State3 The candidate wins the election, and is now cluster leader. Both servers now agree on the term. This looks more or less like what we'd expect. Let's finish this stage of the model by doing a little validation. We'll try to validate in a way that will still be useful after we add more features to the model. Validation What's important here? Well, there's the set of standard transition-system properties we'd like to check. E.g., All of these transitions (except the no-op) should be mututally exclusive. It should be possible to execute all the transitions. But we also have some domain-specific properties: No server should ever transition directly from Leader to Candidate. It should be possible to witness two elections in a row. It should be possible for two different servers to win elections in the same trace. It should be invariant that there is only ever at most one Leader. We could go on, but let's stop with these, since we're still working at a fairly high level. Problem: Prefix Unsatisfiable I wrote a test like this: sat_start_make_win: { (some s: Server | startElection[s]) next_state (some s1, s2: Server | makeVote[s1, s2]) next_state next_state (some s: Server | winElection[s]) } is sat This is a useful pattern because it only requires a prefix . So if it's unsatisfiable (and it is, oops!) we can comment out the transitions in reverse order to easily discover where the problem lies. At the moment, I need to comment out both the makeVote and winElection transitions to make this satisfiable, which means there's probably some sort of issue with makeVote. Initial-state I've left out the init predicate from the above test, although once we fix the issue we should add it back in. This way we've learned about the problem without init being involved at all. In these situations, I like to try unsat cores. If the core is small, we might learn something quickly. option solver MiniSatProver
option logtranslation 1
option coregranularity 1
option core_minimization rce The core I get only highlights one line, which would seem to indicate that the makeVote transition just can't fire from the second state: next_state (some s1, s2: Server | makeVote[s1, s2]) Let's see if it can ever fire: eventually (some s1, s2: Server | makeVote[s1, s2]) Indeed, this is unsatisfiable by itself. So what's wrong with makeVote? Notice that there's no constraint at all on what happened before the transition in this run; whatever is wrong has a very strong effect. Let's first check whether the guard of makeVote can be satisfied: some voter, c: Server | { no voter.votedFor -- GUARD: has not yet voted voter in Follower -- GUARD: avoid Leaders voting c.role = Candidate -- GUARD: election is running noLessUpToDateThan[c, voter] -- GUARD: candidate is no less updated } Still unsatisfiable! What in the world is wrong? I increase the core granularity and translation log settings from 1 to 2; this is expensive, and sometimes leads to confusing output, but can give a finer-grained core. Now Forge blames two things: the fact that voter is a Server; and voter in Follower + Candidate. At this point, it's clear what the problem is. I made a terrible typo in my model. Follower and Candidate areRoles, and so voter can never be in them; I should have written voter.role in Follower + Candidate instead. Error? I worked on this model during the summer of 2024, during which I was also cleaning up Forge's error-handling code. So I was both annoyed and pleased to encounter this problem—this should have given me an error, telling me that voter and Follower+Candidate were necessarily disjoint! Even if this specific issue doesn't happen to you, I'm leaving the debugging process in. Hopefully it's useful. I'll remove the unsat-core options now, since they reduce performance. Another Problem: Only One Election Our test for "It should be possible to witness two elections in a row." has failed. In retrospect, this isn't surprising: there is no transition that models a Leader stopping its leadership. I neglected to add a transition for this sentence in the paper: If a candidate or leader discovers that its term is out of date, it immediately reverts to follower state. We'll add that now as a stepDown transition, and add it to the overall trace predicate: /** If a candidate or leader discovers that its term is out of date, it immediately reverts to follower state. If the leader’s term (included in its RPC) is at least as large as the candidate’s current term, then the candidate recognizes the leader as legitimate and returns to follower state. */
pred stepDown[s: Server] { -- Two guard cases { -- GUARD: is leader, someone has a higher term (abstracted out message) s.role in Leader and (some s2: Server-s | s2.currentTerm > s.currentTerm) } or { -- GUARD: is candidate, someone claims to be leader and has term no smaller s.role in Candidate and (some s2: Server-s | s2.role = Leader and s2.currentTerm >= s.currentTerm) } -- ACTION: step down s.role' = Follower -- FRAME: all others equal; s same currentTerm and votedfor. all x: Server | { x.currentTerm' = x.currentTerm x.votedFor' = x.votedFor (x != s) => x.role' = x.role }
} Unfortunately, there are two problems still: Adding this transition isn't enough. It can't actually fire, because we have no way for a higher term number to be seen. Even though we abstracted out the network and just let the servers see each others' terms directly, there is not yet anything that might cause one server's term to exceed another's. This tells me that maybe it's almost time to actually model the network, or add some other component we're currently missing. What I said above wasn't actually clear, was it? We still have the startElection transition, which (at the moment) allows any Follower to become a candidate, and then servers can vote for them. If they win, they'd become Leader. So why can't we see this? Let's resolve the second issue first. We'll use a telescoping prefix run to debug this. At first, we'll just add one more transition to our existing test. Can we even start a second election? -- Start -> Vote -> Win -> Start run { (some s: Server | startElection[s]) next_state (some s1, s2: Server | makeVote[s1, s2]) next_state next_state (some s: Server | winElection[s]) next_state next_state next_state (some s: Server | startElection[s]) } Yes! Ok, good. Let's add the next step: we should be able to see someone vote for that server. So we can reference the second Candidate, we'll combine the two transitions like this: next_state next_state next_state { some s: Server | { startElection[s] next_state (some s2: Server | makeVote[s2, s]) }} This is now unsatisfiable. So the problem may be in that second vote being made. Let's back up to what we had before and run it, then check what the final state can look like, after the second election begins. If we're looking at a trace prefix, we should add init to the beginning of the run, to make sure we don't get confused (unhelpfully!) by a garbage start state. The first instance I see contains 2 Servers. We see that the original Leader still has that role, and the new contender has the Candidate role (as we would expect). But now nobody can vote at all, because the only non-Leader has already voted (for themselves). What about a larger instance? Adding for exactly 4 Server to the run leads to unsat. (Oh, no! We should consider why in a minute.) Adding for exactly 3 Server to the run is satisfiable. (Whew.) Now there is a Follower, and we can see that their term has been cleared in the last state. So why can't they vote ? Time to re-enable unsat cores. This time the core is bigger. I'll put what it blames inside a spoiler tag; read if you're curious. Unsat core result init When s wins an election, s.role' = Leader Three lines in makeVote: no voter.votedFor; voter.votedFor' = c; and all s: Server | (s.role' = s.role and s.currentTerm' = s.currentTerm) (Notice that this actually omits one of the constraints inside the all; this is one of the benefits of increasing the core granularity. However, there's a consequence: these kinds of "partial" quantified formulas don't always highlight well in VSCode. As a backup, you can always look at the console output to see a readout of the formulas in the core.) Three lines in startElection: s.role = Follower; s.role' = Candidate; and A piece of the all-quantified frame condition again, this time: (all other : Server - s | other.votedFor' = other.votedFor && other.currentTerm' = other.currentTerm). The uniqueness of roles, shown as a highlight on the field declaration: var role: one Role. Whew, that's more than we'd ideally have to look through! And it's incredibly confusing, because it still looks as if we ought to be able to take the makeVote transition with the 3rd Server. The problem is simple, and the core doesn't really help us find it. We're still using the default trace length maximum: 5 states. Count how many I'm asking for: initial state; election 1 has just started; someone has voted; someone has won the election; election 2 has just started; and someone has voted. This is too many states! We'll fix the problem by saying option max_tracelength 10. This fixes one problem, but I'm still curious why for 4 Server was unsatisfiable. It still is, even at the longer maximum trace length. So I start collapsing the trace: no 2nd vote, no 2nd election, ... In the end, this is where it becomes satisfiable: init
(some s: Server | startElection[s])
next_state (some s1, s2: Server | makeVote[s1, s2]) So in a 4-server cluster, nobody can actually win an election? That's silly. But actually it was me being silly. In order to win the election, a server needs a majority vote. If there are 4 servers, there need to be 3 votes for the new winner. But I only had one makeVote transition! If I make that fix to my run, all is well: run { init (some s: Server | startElection[s]) next_state (some s1, s2: Server | makeVote[s1, s2]) next_state next_state (some s1, s2: Server | makeVote[s1, s2]) next_state next_state next_state (some s: Server | winElection[s]) } for exactly 4 Server Importantly, after all the above fixes, the tests all pass . I think we're now ready to do more modeling. Because network failures are so important for understanding Raft, I think we ought to model that. We just need to choose between a couple different perspectives. E.g., we could pick one of these: Network messages . We'd have a "bag" of messages in flight, which could be received. But they could also be dropped, replayed, etc. Network connectivity . This would be a more abstract model, and perhaps more efficient. We wouldn't be able to represent specific RPC messages, but we'd be able to tell when one server could hear another. I'm going to go with the first option, because if I want to understand Raft, I probably need to understand the messages that servers send one another.

189.body:
I'll start with this very simple model: #lang forge/temporal /* A simple model of message passing. To the extent possible, this model should be domain-inspecific; it can be imported and its predicates called from the transitions of other models. NOT MODELED: message replay, message alteration in transit
*/ abstract sig Message {}
one sig Network { var messages: set Message } /** When the system starts, there are no messages "in flight". */
pred message_init { no Network.messages
} /** Add a message to the set of messages "in flight". */ pred send[m: Message] { m not in Network.messages Network.messages' = Network.messages + m
} /** A message can also be received if it's "in flight". */
pred receive[m: Message] { m in Network.messages Network.messages' = Network.messages - m
} /** A message might be dropped. On the surface, this is the same as `receive`. */
pred drop[m: Message] { m in Network.messages Network.messages' = Network.messages - m
} We'll use the drop predicate to represent a large number of potential communication issues, all of which would prevent a server from seeing another's messages. Let's remember to add message_init to the init predicate of our leader-election model.

190.body:
But what should those messages look like? We'll define them in yet another module. This one is a bit long, but it's mostly comments taken almost verbatim from figure 2 of the Raft paper. #lang forge/temporal /* Modeling (a subset of) Raft's RPC messages.
*/ open "messages.frg" abstract sig Role {}
one sig Follower, Candidate, Leader extends Role {} sig Server { var role: one Role, var votedFor: lone Server, var currentTerm: one Int } /** Now we need a notion of intended sender and receiver. */
sig RaftMessage extends Message { from, to: one Server
} /** Nothing here yet. */
sig Entry {} /** From figure 2: Arguments: term (candidate’s term) candidateID (candidate requesting vote) lastLogIndex (index of candidate’s last log entry) lastLogTerm (index of candidate’s last log term) Results: term: currentTerm, for candidate to update itself voteGranted: true means candidate received vote Receiver implementation: 1. Reply false if term < currentTerm (§5.1) 2. If votedFor is null or candidateId, and candidate’s log is at least as up-to-date as receiver’s log, grant vote (§5.2, §5.4)
*/
sig RequestVote extends RaftMessage { requestTerm: one Int, candidateID: one Server, lastLogIndex: one Int, lastLogTerm: one Int
}
sig RequestVoteReply extends RaftMessage { replyTerm: one Int, voteGranted: lone Server -- represent true boolean as non-empty
} /** From figure 2: Arguments: term (leader’s term) leaderId (so follower can redirect clients) prevLogIndex (index of log entry immediately preceding new ones) prevLogTerm (term of prevLogIndex entry) entries[] (log entries to store (empty for heartbeat; may send more than one for efficiency)) leaderCommit (leader’s commitIndex)
Results: term (currentTerm, for leader to update itself) success (true if follower contained entry matching prevLogIndex and prevLogTerm) Receiver implementation: 1. Reply false if term < currentTerm (§5.1) 2. Reply false if log doesn’t contain an entry at prevLogIndex whose term matches prevLogTerm (§5.3) 3. If an existing entry conflicts with a new one (same index but different terms), delete the existing entry and all that follow it (§5.3) 4. Append any new entries not already in the log 5. If leaderCommit > commitIndex, set commitIndex = min(leaderCommit, index of last new entry)
*/
sig AppendEntries extends RaftMessage { appendEntriesTerm: one Int, leaderID: one Server, prevLogIndex: one Int, prevLogTerm: one Int, entries: set Entry, leaderCommit: one Int
}
sig AppendEntriesReply extends RaftMessage { appendEntriesReplyTerm: one Int, success: lone Server -- represent true boolean as non-empty
} Notice we moved Server and Role; we added Entry Because I wanted the RPC model to refer to Server, I moved those basic definitions into the RPC model. The expanded leader-election model will import the RPC model. I also added Entry, because it's needed for one of the messages. But it's just an empty sig for the moment, because we aren't modeling that yet.

192.body:
We need to expand on startElection to have the candidate send RequestVote messages to all other servers. In principle, this should be easy if we set up the other files correctly. We even left ourselves a convenient note in the Forge file: ACTION: issues RequestVote calls. Since Forge doesn't have a notion of manufacturing a brand new Message atom, we'll use some to say that an unused Message just happens to exist, then constrain its fields. Finally, we'll invoke send on it to make sure it's added to the "in flight" set. /** Server `s` runs for election. */
pred startElection[s: Server] { s.role = Follower -- GUARD s.role' = Candidate -- ACTION: in candidate role now s.votedFor' = s -- ACTION: votes for itself s.currentTerm' = add[s.currentTerm, 1] -- ACTION: increments term -- ACTION: issues RequestVote calls (NEW) all other: Server - s | { some rv: RequestVote | { rv not in Network.messages -- not currently being used rv.from = s rv.to = other rv.requestVoteTerm = s.currentTerm rv.candidateID = s rv.lastLogIndex = -1 -- TODO: NOT MODELING YET rv.lastLogTerm = -1 -- TODO: NOT MODELING YET send[rv] } } -- FRAME: role, currentTerm, votedFor for all other servers all other: Server - s | { other.votedFor' = other.votedFor other.currentTerm' = other.currentTerm other.role' = other.role }
} I'm a little worried about messages. How many of these will we need? If every time a server becomes a candidate we use just less than #Server messages, I could see needing to give a very high scope, which would cause performance issues. If we hit that point, we will refactor the model—although I like the message-hierarchy style we've currently got. If we do run into scope limitations, we might consider making message fields var, but enforcing they remain constant while the message is in transit. That would allow message atoms to be re-used. We need to import both the messages and RPC modules to make this run. And all the tests still pass (although notice that we aren't testing the new predicates at all yet). We can even run the model and get instances which now show the state of the network. Of course, we don't yet receive anything. The doNothing predicate Notice that the barely-constrained no-op predicate is doing more work for us. Without it, our model would have just become unsatisfiable, since we'd have no way to build the lasso-trace loopback: so far, we can only add messages, but never remove them. The doNothing option really does help when you're adding to a model.

193.body:
A RequestVote message ought to prompt votes, which in turn ought to produce a reply. It's tempting to not model replies, but I'd like to allow the "network" to break in such a way that the Follower believes they've voted but the Candidate is unaware of that fact. So we'll model both of them. Receiving RequestVote should be as easy as sending. We'll modify the makeVote transition, remembering to ensure that the request term isn't smaller than the voter's current term. I also notice that the RPC specification says: "If votedFor is null or candidateId, and candidate’s log is at least as up-to-date as receiver’s log, grant vote", which means I should change the first guard line to be more permissive than it was previously. Finally, we'll remove the old guard constraint that covered for the lack of messages; we now have messages, and no longer needed it. pred makeVote[voter: Server, c: Server] { -- GUARD: has not yet voted *OR* has voted for this candidate (CHANGED) (no voter.votedFor or voter.votedFor = c) voter.role in Follower + Candidate -- GUARD: avoid Leaders voting -- Removed, now that we see an explicit message --c.role = Candidate -- GUARD: election is running (REMOVED) noLessUpToDateThan[c, voter] -- GUARD: candidate is no less updated -- ACTION/GUARD: must receive a RequestVote message (NEW) some rv: RequestVote | { receive[rv] -- enforces message "in flight" rv.to = voter rv.from = c voter.currentTerm <= rv.requestVoteTerm } voter.votedFor' = c -- ACTION: vote for c -- FRAME role, currentTerm for voter -- FRAME: role, currentTerm, votedFor for all others all s: Server | { s.role' = s.role s.currentTerm' = s.currentTerm (s != voter) => (s.votedFor' = s.votedFor) }
} All tests still pass after this change, and we can run to see traces. Great! Now, what about replies? We can add a send for some new RequestVoteReply, but if we do that we should add some way for that message to be received. We'll add the message first as another new block in makeVote, although we need access to the request message, so I'll add this within the rv quantifier: -- ACTION/GUARD: must send a RequestVoteReply message (NEW) some rvp: RequestVoteReply | { send[rvp] -- enforces message not in flight rvp.to = c rvp.from = voter rvp.voteGranted = c -- stand-in for boolean true rvp.replyRequestVoteTerm = rv.requestVoteTerm } But this makes some is sat tests fail. One reason might be that there are not enough Message atoms: we need one for each RequestVote message sent, and one for each RequestVoteReply. But the default of 4 should suffice if there are only 2 Server atoms: one request, one reply. So we expect something else. The "telescoping prefix" method shows that the problem is with makeVote (not surprising), and the corresponding core is: the line from send that adds the message to the "in flight" set; the line from receive that removes the message from the "in flight" set; the fact that rv is a RequestVote and must be in the "in flight" set when received. What's the problem? Both send and receive have an implicit frame condition. When I write Network.messages' = Network.messages - m, it means that no other changes to Network.messages are possible on this "tick". So using send and receive in the same transition will, as written, be contradictory. Likewise, because requesting a vote happens for many servers at once, this bug would also cause problems if there were more than one Follower. To fix this, I'll add a sendAndReceive pred to the messages module. It will take sets of messages, so that we can send and/or receive multiple messages at a time. /** We might need to send/receive multiple messages. Note that the way this is written, if there is any message in both the to_send and to_receive sets, it will remain "in flight". */
pred sendAndReceive[to_send: set Message, to_receive: set Message] { no to_send & Network.messages to_receive in Network.messages Network.messages' = (Network.messages - to_receive) + to_send
} Now we can edit the startElection and makeVote predicates to use this instead of just send and receive. The first is a bit challenging, because we need to build the set of messages and pass it all at once. But we also need to make sure the right message atoms actually exist. So we'll split this into two parts: existence and identity. -- ACTION: issues RequestVote calls (MODIFIED) // The set of unused messages exists all other: Server - s | { some rv: RequestVote | { rvFor[s, other, rv] } } // They are all actually sent, with nothing received sendAndReceive[{rv: RequestVote | some other: Server | rvFor[s, other, rv]}, none & Message] -- ^ Interestingly we need to do the intersection here, so the checker understands this empty set -- can't have type `Int`. What about makeVote? That's easier, because we have a single message to receive and a different, single message to send. We end up changing the message block we had before just a bit: -- ACTION/GUARD: must receive a RequestVote message (NEW) -- ACTION/GUARD: must send a RequestVoteReply message (NEW) some rv: RequestVote, rvp: RequestVoteReply | { rv.to = voter rv.from = c voter.currentTerm <= rv.requestVoteTerm rvp.to = c rvp.from = voter rvp.voteGranted = c -- stand-in for boolean true rvp.replyRequestVoteTerm = rv.requestVoteTerm sendAndReceive[rvp, rv] -- enforces message "unused"/"used" respectively } Framing and composition As written, any transition that doesn't use one of the message predicates, or speak of Network.messages directly itself, will allow the message bag to change arbitrarily. E.g., our winElection transition doesn't yet refer to the network, and so that slice of the system's state is unconstrained on this transition. For now, we'll go and add the following to every transition except the two we've already changed: -- Frame the network state explicitly sendAndReceive[none & Message, none & Message]

194.body:
In order to actually receive these replies, we need a new transition. Or do we? We might choose to have the RequestVoteReply messages get received all at once, as part of stepping down or winning the election. This isn't exactly in accordance with reality, but we're using the message buffer as a stand-in for the record of how many votes each server receives over the course of the election. This consumes less of our max_tracelength than receiving them all one at a time and explicitly storing votes in a Server field. Let's give that idea try to start with. We'll just have receiveMajorityVotes examine and change the currently "in flight" messages. /** Server `s` is supported by a majority of the cluster. E.g., |cluster| = 5 ---> need 5/2 + 1 = 3 votes. */
pred receiveMajorityVotes[s: Server] { -- This formulation identifies the set of replies destined for this server, -- and evaluates to true if they get removed from the message bag and there are -- a sufficient number of them granting a vote. let voteReplies = {m: Network.messages & RequestVoteReply | m.to = s} | { receive[voteReplies] #{m: voteReplies | some m.voteGranted} > divide[#Server, 2] }
} As always, we'll check that we can generate a pertinent prefix. Here's what I ran: run { init (some s: Server | startElection[s]) next_state (some s1, s2: Server | makeVote[s1, s2]) next_state next_state (some s1, s2: Server | makeVote[s1, s2]) next_state next_state next_state (some s: Server | winElection[s])
} for exactly 3 Server, 10 Message Unsatisfiable again ! But this isn't unusual; often when we make a change there's some factor we forgot to account for. We'll follow the same recipe as before, removing constraints from the end of the prefix until we reach satisfiability. We don't have to do much, because only the last transition seems to cause a problem—unsurprising, since the conditions for winning are what we just changed. The unsat core has only 3 formulas in it. Rather than just looking at code location, let's examine what the command-line output says. I'll add newlines to make it a bit more readable: Unsat core available (3 formulas):
Core(part 1/3): [/Users/tbn/repos/cs1710/newbook/book/src/chapters/raft/messages.frg:32:4 (span 40)] (Network.messages' = Network.messages - {m : Network.messages & RequestVoteReply | m.to = s})
Core(part 2/3): [/Users/tbn/repos/cs1710/newbook/book/src/chapters/raft/raft_2.frg:124:8 (span 59)] (#{m : {m : Network.messages & RequestVoteReply | m.to = s} | some m.voteGranted} > divide[#Server, 2])
Core(part 3/3): [/Users/tbn/repos/cs1710/newbook/book/src/chapters/raft/messages.frg:47:4 (span 61)] (Network.messages' = Network.messages - none & Message + none & Message) The command-line core output prints core formulas after substitution . So, for example, (Network.messages' = Network.messages - none & Message + none & Message) is the result of applying sendAndReceive (defined in messages.frg) to the arguments none & Message and none & Message. But that's not surprising: the winElection predicate actually contains the frame condition sendAndReceive[none & Message, none & Message]. No, what's far more suspicious is the apparent tangle between the frame condition and the first formula, which calls receive. This is how we've currently defined receive: pred receive[m: Message] { m in Network.messages Network.messages' = Network.messages - m
} And there's the problem: that pesky =. If we call receive and sendAndReceive in the same transition, they will conflict with each other! So we need to be a bit more clever in how we write winElection. But it's annoying, because the call to receive is inside a helper predicate: receiveMajorityVotes. I don't want to inline the helper-predicate body, because that would clutter the transition predicate. But, wait. Do we really need to re-frame the network state in this predicate? Probably not, since the only modification comes from receiveMajorityVotes. And that already frames the state of the network. So we'll remove this line entirely: sendAndReceive[none & Message, none & Message] We don't need it at all! And now we're back to satisfiable, and we can view a run of the protocol. And most of our validation suite passes too, which is comforting. There's just one thing that fails: It should be possible for two different servers to win elections in the same trace. My first thought is that maybe we haven't given Forge enough states to witness this. But then I remembered that we were just making winning possible again. Is it ever possible for a leader to stop being a leader in our current model? We have a passing test that looks for such a pattern, or so I thought. Here it is as a predicate: pred two_elections_in_a_row { electionSystemTrace eventually { some s: Server | startElection[s] next_state eventually (some s2: Server | startElection[s2]) }
} But this doesn't mean what it says. It's not two different elections . It's two startElection actions . This could be satisfied by two candidates running for leader in the same election cycle. So let's write a better test. As an experiment, let's write it in terms of server roles rather than transitions: pred two_elections_in_a_row { electionSystemTrace eventually { -- At time t, someone is a candidate some s: Server | s.role = Candidate eventually { -- At time t2, nobody is a candidate no s: Server | s.role = Candidate eventually { -- At time t3, someone (same or different) is a candidate again some s: Server | s.role = Candidate } } }
} Let's try something simpler. Can a leader ever stop being a leader? leader_stops_leading: { electionSystemTrace eventually { some s: Server | s.role = Leader eventually { no s: Server | s.role = Leader } } } is sat Unsatisfiable. No. Wait—we know our stepDown transition can be satisfied, but maybe it's buggy. This generates a trace: (some s: Server | startElection[s])
next_state (some s1, s2: Server | makeVote[s1, s2])
next_state next_state (some s: Server | winElection[s])
next_state next_state next_state (some s: Server | startElection[s])
next_state next_state next_state next_state (some s: Server | stepDown[s]) This looks like what we expected. So where's the discrepancy between this and leader_stops_leading? > electionSystemTrace
false Uh oh. I forgot to assert that the trace starts in an initial state. Adding that makes the above unsatisfiable. But it also becomes unsatisfiable even without the stepDown transition. I go back to my basic tests, and realize I had forgotten to add init in several of them! After fixing this, one fails: -- Start -> Vote -> Win sat_start_make_win: { init (some s: Server | startElection[s]) next_state (some s1, s2: Server | makeVote[s1, s2]) next_state next_state (some s: Server | winElection[s]) } for 6 Message is sat Yes, this happens! Sometimes you'll be working on a model, and then realize you neglected something that might force changes throughout. You may have seen this happen when working on a program; it's the same here. I'm deliberately leaving this in rather than cleaning it up so you can see how I deal with the issue. If I remove the win requirement, it passes. So something still isn't right with winElection; possibly with message passing. The unsat core makes me also think there might be a problem with numbers of messages, because it points to this line: Core(part 5/6): [/Users/tbn/repos/cs1710/newbook/book/src/chapters/raft/raft_2.frg:117:8 (span 59)] (#{m : {m : Network.messages & RequestVoteReply | m.to = s} | some m.voteGranted} > divide[#Server, 2]) The problem is that, before we added messages, we measured a majority vote by looking directly at everyone's votedFor field. The candidate votes for themself, but doesn't send a vote reply . So we need to look for one less reply message than we expect votes for the candidate: let voteReplies = {m: Network.messages & RequestVoteReply | m.to = s} | { receive[voteReplies] #{m: voteReplies | some m.voteGranted} > add[-1, divide[#Server, 2]]
} Now we see an instance again. And, after we make one small change, all our tests pass once again (even after adding init where it was needed). (The small change is to require the winner of an election to actually be a Candidate; one of our tests was failing because a server could win without starting an election in a cluster of size 1.)

