Model 3 At this point, I copied the entire model into a new file, so that it would be clear where we were after the above section. For myself, I could use a Git commit to find the model state, but I want to share these separately. It would be nice to make the degree of network failure adjustable, so we can check how Raft does under certain conditions. So we'll break out the various kinds of network failure into their own predicates and then see if we can add them cleanly to our model as a new transition type. We'll want to model at least: messages being dropped by the network, rather than delivered; and messages being duplicated by the network. We already wrote something for the message-drop case: /** A message might be dropped. On the surface, this is the same as `receive`. This is a single-change predicate: if used, it will preclude other message activity within a transition. */
pred drop[m: Message] { m in Network.messages Network.messages' = Network.messages - m
} Let's write something similar for duplication. It starts out quite well, but then we encounter a problem: /** A message might be duplicated. This asserts that another Message atom exists (in flight), having the same content as the other. */
pred duplicate[m1: Message] { m1 in Network.messages some m2: Network.messages - m1 | { // *** THEY MUST BE THE SAME KIND OF MESSAGE, AND HAVE SAME FIELD VALUES *** Network.messages' = Network.messages + m2 }
} The problem is that here, in messages.frg, we have no information about the kinds of Message that will be defined. So we can't say that m is of the same type as m2, or that they have equal field values. To make this work, we'd either need Forge to support something vaguely like dynamic dispatch (perhaps via built-in helpers like sameSig[x,y] and eqFields[x,y]) or to move this predicate up into a file that has knowledge of message types: rpc.frg. Because I'm working with Forge today, not working on Forge, we'll go with the latter option. /** A message might be duplicated. This asserts that another Message atom exists (in flight), having the same content as the other. */
pred duplicate_rv[m1: RequestVote] { m1 in Network.messages m1 in RequestVote some m2: Network.messages - m1 | { // *** THEY MUST BE THE SAME KIND OF MESSAGE, AND HAVE SAME FIELD VALUES *** m2 in RequestVote m2.requestVoteTerm = m1.requestVoteTerm m2.candidateID = m1.candidateID m2.lastLogIndex = m1.lastLogIndex m2.lastLogTerm = m1.lastLogTerm Network.messages' = Network.messages + m2 }
} This isn't ideal. There's probably a better way to handle this without a lot of code duplication. But for now we'll press on. Alloy Note to self: Do I remember that Alloy has some undocumented reflection features? TODO: look into this. Let's add the potential for the network to take an action to our main model, in rpc.frg: /** Helper to keep a server's state constant. Useful in composition. */
pred frame_server[s: Server] { s.role' = s.role s.votedFor' = s.votedFor s.currentTerm' = s.currentTerm
} /** Transition predicate: the network performs some error behavior. */
pred network_error { // One of the various flavors of error occurs (some m: Network.messages | drop[m]) or (some rv: RequestVote | duplicate_rv[rv]) // Server state remains the same all s: Server | frame_server[s]
} We'll add network_error as one of the possibilities in our main transition predicate, too. We're getting quite a long list of possibilities: pred electionSystemTrace { init always { (some s: Server | startElection[s]) or (some s, c: Server | makeVote[s, c]) or (some s: Server | winElection[s]) or (some s: Server | stepDown[s]) or (haltElection) or (election_doNothing) or (network_error) }
