There are PBT libraries for most every popular language. In this book, we'll be using a library for Python called Hypothesis . Hypothesis has many helper functions to make generating random inputs relatively easy. It's worth spending a little time stepping through the library. Let's test a function in Python itself: the median function in the statistics library, which we began this chapter with. What are some important properties of median? CSCI 1710: LLMs and Testing If you're in CSCI 1710, your first homework starts by asking you to generate code using an LLM of your choice, such as ChatGPT. Then, you'll use property-based testing to assess its correctness. To be clear, you will not be graded on the correctness of the code you prompt an LLM to generate . Rather, you will be graded on how good your property-based testing is. Later in the semester, you'll be using PBT again to test more complex software! Now let's use Hypothesis to test at least one of those properties. We'll start with this template : from hypothesis import given, settings
from hypothesis.strategies import integers, lists
from statistics import median # Tell Hypothesis: inputs for the following function are non-empty lists of integers
@given(lists(integers(), min_size=1)) # Tell Hypothesis: run up to 500 random inputs
@settings(max_examples=500)
def test_python_median(input_list): pass # Because of how Python's imports work, this if statement is needed to prevent # the test function from running whenever a module imports this one. This is a # common feature in Python modules that are meant to be run as scripts. if __name__ == "__main__": # ...if this is the main module, then... test_python_median() Let's start by filling in the shape of the property-based test case: def test_python_median(input_list): output_median = median(input_list) # call the implementation under test print(f'{input_list} -> {output_median}') # for debugging our property function if len(input_list) % 2 == 1: assert output_median in input_list # The above checks a conditional property. But what if the list length isn't even? # We should be able to do better! Exercise : Take a moment to try to express what it means for median to be correct in the language of your choice. Then continue on with reading this section. Expressing properties can often be challenging. After some back and forth, we might reach a candidate function like this: def test_python_median(input_list): output_median = median(input_list) print(f'{input_list} -> {output_median}') if len(input_list) % 2 == 1: assert output_median in input_list lower_or_eq = [val for val in input_list if val <= output_median] higher_or_eq = [val for val in input_list if val >= output_median] assert len(lower_or_eq) >= len(input_list) // 2 # int division, drops decimal part assert len(higher_or_eq) >= len(input_list) // 2 # int division, drops decimal part Unfortunately, there's a problem with this solution. Python's median implementation fails this test! Hypothesis provides a random input on which the function fails: input_list=[9502318016360823, 9502318016360823]. Give it a try! This is what my computer produced; what happens on yours? Exercise: What do you think is going wrong? Think, then click! Here's what my Python console reports: >>> statistics.median([9502318016360823, 9502318016360823])
9502318016360824.0 I really don't like seeing a number that's larger than both numbers in the input set. But I'm also suspicious of that trailing .0. median has returned a float, not an int. That might matter. But first, we'll try the computation that we might expect median to run: >>> (9502318016360823*2)/2
9502318016360824.0 What if we force Python to perform integer division? >>> (9502318016360823*2)//2
9502318016360823 Could this be a floating-point imprecision problem? Let's see if Hypothesis can find another failing input where the values are smaller. We'll change the generator to produce only small numbers, and increase the number of trials hundredfold: @given(lists(integers(min_value=-1000,max_value=1000), min_size=1))
@settings(max_examples=50000) No error manifests. That doesn't mean one couldn't , but it sure looks like large numbers make the chance of an error much higher. The issue is: because Python's statistics.median returns a float, we've inadvertently been testing the accuracy of Python's primitive floating-point division, and floating-point division is known to be imprecise in some cases. It might even manifest differently on different hardware—this is only what happens on my laptop! Anyway, we have two or three potential fixes: bound the range of potential input values when we test; check equality within some small amount of error you're willing to tolerate (a common trick when writing tests about float values); or change libraries to one that uses an arbitrary-precision, like BigNumber . We could adapt our test fairly easily to that setting, and we'd expect this problem to not occur. Which is best? I don't really like the idea of arbitrarily limiting the range of input values here, because picking a range would require me to understand the floating-point arithmetic specification a lot more than I do. For instance, how do I know that there exists some number x before which this issue can't manifest? How do I know that all processor architectures would produce the same thing? Between the other two options (adding an error term and changing libraries) it depends on the engineering context we're working in. Changing libraries may have consequences for performance or system design. Testing equality within some small window may be the best option in this case, where we know that many inputs will involve float division.

