} Int is a built-in sig provided by Forge. To learn more about how Forge handles integers, see Integers in Forge . Example: Sig with No Fields Example - Basic Sig without Fields: Not every sig in a model needs to have fields to be a useful part of the model! sigs with no fields are often used in conjunction with other sigs that reference them. One such example might look like this: sig Student {}
