These definitions sketch the overall shape of a board: players, marks on the board, and so on. But not all boards that fit the definition will be valid. For example: Forge integers aren't true mathematical integers, but are bounded by a bitwidth we give whenever we run the tool. So we need to be careful here. We want a classical 3-by-3 board with indexes of (say) 0, 1, and 2, not a board where (e.g.) row -5, column -1 is a valid location. We'll call these well-formedness constraints. They aren't innately enforced by our sig declarations, but we'll almost always want Forge to enforce them, so that it doesn't find "garbage instances". Let's write a wellformedness predicate : -- a Board is well-formed if and only if:
pred wellformed[b: Board] { -- row and column numbers used are between 0 and 2, inclusive all row, col: Int | { (row < 0 or row > 2 or col < 0 or col > 2) implies no b.board[row][col] }
} Comments in Forge Forge treats either -- or // as beginning a line-level comment, and /* ... */ as denoting a block comment. This is different from the Python code we saw in the last section! In Forge, # has a different meaning. This predicate is true of any Board if and only if the above 2 constraints are satisfied. Let's break down the syntax: Constraints can quantify over a domain. E.g.,all row, col: Int | ... says that for any pair of integers (up to the given bitwidth), the following condition (...) must hold. Forge also supports, e.g., existential quantification (some), but we don't need that yet. We also have access to standard boolean operators like or, implies, etc. Formulas in Forge always evaluate to a boolean; expressions evaluate to sets. For example, the expression b.board[row][col] evaluates to the Player (if any) with a mark at location (row, col) in board b; but the formula no b.board[row][col] is true if and only if there is no such `Player``. A pred (predicate) in Forge is a helper function that evaluates to a boolean. Thus, its body should always be a formula. Predicates are declarative Notice that, rather than describing a process that produces a well-formed board, or even instructions to check well-formedness, we've just given a declarative description of what's necessary and sufficient for a board to be well-formed. If we'd left the predicate body empty, any board would be considered well-formed—there'd be no formulas to enforce!

