Forge supports several different testing constructs: example, for expressing that specific instances should satisfy (or not satisfy) a predicate; assert, for expressing that a specific predicate should be necessary or sufficient for another; and test expect, an expressive and general form that can be somewhat more difficult to use. If tests pass, they do not open the visualizer, making them well-suited for building test suites for your Forge models. Note on terminology : we will sometimes refer to assert and (some) test expect tests as property tests . This is because they can be used to express sweeping expectations about predicates, rather than just the point-wise, single-instance expectations that example can. Shared Context All the subsections below contain tests for the same small model of tic-tac-toe: abstract sig Player {}
one sig X, O extends Player {}
sig Board { board: pfunc (Int -> Int) -> Player }
pred wellformed { all b: Board | all row, col: Int | { (row < 0 or row > 2 or col < 0 or col > 2) implies no b.board[row][col] } }

