The example syntax lets you test whether a specific instance is satisfied by some predicate in your model. An example contains three parts: a name for the example; which predicate the instance should satisfy (or not satisfy); and the instance itself. Example This example, named diagonalPasses, expresses that a board where X has moved in the upper-left, middle, and lower-right squares (and O has made no moves at all) should satisfy the wellformed predicate: example diagonalPasses is {wellformed} for { Board = `Board0 X = `X0 O = `O0 A = `A0 B = `B0 C = `C0 `Board0.board = (0,0)->`X + (1,1)->`X + (2,2)->`X
} Notice that the example needs to give a value for all sigs and all fields, even the one sigs. Examples are analogous to unit tests in Forge. Every example says that if the instance were passed to the predicate, the predicate would return true (or false). This means that examples are a great way to explore potential design choices and map out your intent when modeling. Temporal Forge The example keyword is not supported in Temporal Forge. How do examples work? An example passes if and only if the instance given is consistent with the predicate given. Total vs. partial instances If you leave a sig or field unbound in an example, Forge is free to assign that sig or field in any way to achieve consistency with the predicate. The consequence is that it is possible to write apparently contradictory examples that pass. E.g., in the above example, if we left out the binding for board: example exampleYes is {wellformed} for { Board = `Board0 X = `X0 O = `O0 A = `A0 B = `B0 C = `C0 }
example exampleNo is {not wellformed} for { Board = `Board0 X = `X0 O = `O0 A = `A0 B = `B0 C = `C0 } Both of these examples would pass vs. the wellformed predicate, because Forge can find values for the board field that either satisfy or dissatisfy the wellformed predicate.

