The assert syntax allows you to write tests in terms of necessary and sufficient properties for a predicate. Assertions If we first define these two predicates: pred fullFirstRow {some b: Board | b.board[0][0] = X and b.board[0][1] = X and b.board[0][2] = X}
pred someMoveTaken {some b: Board, row, col: Int | some b.board[row][col] } we can then write two assertions: assert fullFirstRow is sufficient for winning for 1 Board
assert someMoveTaken is necessary for winning for 1 Board which should both pass, since: if X occupied the entire first row, it has won; and if someone has won the game, there must be moves taken on the board. Assertions also support universal quantification (i.e. all, but not some, one, lone, etc). For example, if you instead wrote the predicates: AssertionsQuant pred fullFirstRow[b : Board] {b.board[0][0] = X and b.board[0][1] = X and b.board[0][2] = X}
pred someMoveTaken[b : Board, row : Int, col : Int] {some b.board[row][col] } You could write the assertions assert all b : Board | fullFirstRow[b] is sufficient for winning for 1 Board
assert all b : Board, row, col : Int | someMoveTaken[b, row, col] is necessary for winning for 1 Board Assertions are an excellent way to check and document your goals and assumptions about your model. In a more complex setting, we might write assertions that enforce: Dijkstra's algorithm doesn't terminate until the destination vertex has been reached; for a game of chess to be won, a king must be in check; or someone must first be logged into Gmail to read their mail.

