How do we tell when it's a given player's turn? It's X's turn when there are the same number of each mark on the board: pred XTurn[s: Board] { #{row, col: Int | s.board[row][col] = X} = #{row, col: Int | s.board[row][col] = O}
} Here, we're measuring the size of 2 sets. The {row, col: Int | ...} syntax is called a set comprehension . A set comprehension defines a set. We're defining the set of row-column pairs where the board contains one of the player marks. The # operator gives the size of these sets, which we then compare. Exercise: Is it enough to say that OTurn is the negation of XTurn? That is, we could write: pred OTurn[s: Board] { not XTurn[s: Board]}. This seems reasonable enough; why might we not want to write this? Think, then click! Because we defined X's turn to be when the number of X's and O's on the board are in balance. So any other board would be O's turn, including ones that ought to be illegal, once we start defining moves of the game. Instead, let's say something like this: pred OTurn[s: Board] { -- It's O's turn if X has moved once more often than O has #{row, col: Int | s.board[row][col] = X} = add[#{row, col: Int | s.board[row][col] = O}, 1]
} Integer addition Forge supports arithmetic operations on integers like add. Forge integers are signed (i.e., can be positive or negative) and are bounded by a bit width , which defaults to 4 bits. The number of available integers is always $2^k$, where $k$ is the bit width. Forge follows the 2's complement arithmetic convention, which means that the available integers are split evenly between positive and negative numbers, but counting 0 as "positive". So with 4 bits, we can represent numbers between -8 and 7 (inclusive). This means that (while it doesn't matter for this model yet), arithmetic operations can overflow—just like primitive integers in languages like Java! For example, if we're working with 4-bit integers, then add[7,1] will be -8. You can experiment with this in the visualizer's evaluator , which we'll be using a lot after the initial modeling tour is done. Use add for addition, not + Don't try to use + for addition in any Forge language. Use add instead; this is because + is reserved for something else (which we'll explain later).

