What does it mean to win ? A player has won on a given board if: they have placed their mark in all 3 columns of a row; they have placed their mark in all 3 rows of a column; or they have placed their mark in all 3 squares of a diagonal. We'll express this in a winner predicate that takes the current board and a player name. Let's also define a couple helper predicates along the way: pred winRow[s: Board, p: Player] { -- note we cannot use `all` here because there are more Ints some row: Int | { s.board[row][0] = p s.board[row][1] = p s.board[row][2] = p }
} pred winCol[s: Board, p: Player] { some column: Int | { s.board[0][column] = p s.board[1][column] = p s.board[2][column] = p } } pred winner[s: Board, p: Player] { winRow[s, p] or winCol[s, p] or { s.board[0][0] = p s.board[1][1] = p s.board[2][2] = p } or { s.board[0][2] = p s.board[1][1] = p s.board[2][0] = p } } After writing these domain predicates, we're reaching a fairly complete model for a single tic-tac-toe board. Let's decide how to fix the issue we saw above (the reason why OTurn couldn't be the negation of XTurn): perhaps a player has moved too often. Should we add something like OTurn[s] or XTurn[s] to our wellformedness predicate? No! If we then later enforced wellformedness for all boards, that would exclude "cheating" instances where a player has more moves on the board than are allowed. But this has some risk, depending on how we intend to use the wellformed predicate: If we were only ever generating valid boards , a cheating state might well be spurious, or at least undesirable. In that case, we might prevent such states in wellformed and rule it out. If we were generating arbitrary (not necessarily valid) boards, being able to see a cheating state might be useful. In that case, we'd leave it out of wellformed. If we're interested in verification , e.g., we are asking whether the game of Tic-Tac-Toe enables ever reaching a cheating board, we shouldn't add not cheating to wellformed; because wellformed also excludes garbage boards, we'd probably use it in our verification—in which case, Forge will never find us a counterexample! Modeling vs. PBT Notice the similarity between this issue and what we do in property-based testing. Here, we're forced to distinguish between what a reasonable board is (analogous to the generator's output in PBT) and what a reasonable behavior is (analogous to the validity predicate in PBT). One narrows the scope of possible worlds to avoid true "garbage"; the other checks whether the system behaves as expected in one of those worlds. We'll come back to this later, when we've had a bit more modeling experience. For now, let's separate our goal into a new predicate called balanced, and add it to our run command above so that Forge will find us an instance where some board is both balanced and wellformed: pred balanced[s: Board] { XTurn[s] or OTurn[s]
}
run { some b: Board | wellformed[b] and balanced[b]} If we click the "Next" button a few times, we see that not all is well: we're getting boards where wellformed is violated (e.g., entries at negative rows, or multiple moves in one square). Why is this happening? We're getting this because of how the run was phrased. We said to find an instance where some board was well-formed and valid, not one where all boards were. Our run is satisfied by any instance where at least one Board is wellformed; the others won't affect the truth of the constraint. By default, Forge will find instances with up to 4 Boards. So we can fix the problem either by telling Forge to find instances with only 1 Board: run { some b: Board | wellformed[b] and balanced[b]} for exactly 1 Board or by saying that all boards must be well-formed and balanced: run { all b: Board | wellformed[b] and balanced[b]}

