~sig Node {
~ key: one Int, -- every node has some key ~ left: lone Node, -- every node has at most one left-child
~ right: lone Node -- every node has at most one right-child
~}
~
pred isRoot[n: Node] { -- a node is a root if it has no ancestor no n2: Node | n = n2.left or n = n2.right
} Then we'll use the isRoot helper in our wellformed predicate. But to write this predicate, there's a new challenge. We'll need to express constraints like "no node can reach itself via left or right fields". So far we've only spoken of a node's immediate left or right child . Instead, we now need a way to talk about reachability over any number of left or right fields. Forge provides a helper, reachable, that makes this straightforward. The reachable built-in The built-in reachable predicate returns true if and only if its first argument is reachable from its second argument, via all of the remaining arguments. Thus, reachable[n1, anc, left, right] means: "anc can reach n1 via some sequence of left and right fields." For reasons we'll explore later, reachable can be subtle; if you're curious now, see the Static Models Q&A for a discussion of this. Using reachable, we can now write: pred wellformed { -- no cycles: no node can reach itself via a succession of left and right fields all n: Node | not reachable[n, n, left, right] -- all non-root nodes have a common ancestor from which both are reachable -- the "disj" keyword means that n1 and n2 must be _different_ all disj n1, n2: Node | (not isRoot[n1] and not isRoot[n2]) implies { some anc: Node | reachable[n1, anc, left, right] and reachable[n2, anc, left, right] } -- nodes have a unique parent (if any) all disj n1, n2, n3: Node | not ((n1.left = n3 or n1.right = n3) and (n2.left = n3 or n2.right = n3))
}

