It's best to write some positive and negative examples. Why? Well, suppose you needed to test a method or function that returned a boolean, like checking whether an integer is even. Here's an example in Python: def is_even(x: int) -> bool: return x % 2 == 0 What's wrong with this test suite? assert is_even(0) == True assert is_even(2) == True assert is_even(10000) == True assert is_even(-10000) == True The problem isn't only the size of the suite! By testing only values for which we expect True to be returned, we're neglecting half the problem. We'd never catch buggy implementations like this one: def is_even(x: int) -> bool: return True Forge predicates are very like boolean-valued functions, so it's important to exercise them in both directions. Here are some negative examples: A single node that is its own left-child is not well-formed. example n_own_left is {not wellformed} for { Node = `Node0 `Node0.left = `Node0 no `Node0.right
} A single node that is its own right-child is not well-formed. example n_own_right is {not wellformed} for { Node = `Node0 no `Node0.left `Node0.right = `Node0
} A single node that's reachable via a longer cycle using both left- and right-children is not well-formed. example n_mixed_cycle is {not wellformed} for { Node = `Node0 + `Node1 + `Node2 `Node0.left = `Node1 no `Node0.right no `Node1.left `Node1.right = `Node2 `Node2.left = `Node0 no `Node2.right } A "forest" of multiple, disconnected trees is not well-formed. example n_forest is {not wellformed} for { Node = `Node0 + `Node1 no `Node0.left no `Node0.right no `Node1.left no `Node1.right } Sometimes it helps to start with an example. We wouldn't normally be able to check these examples until we'd finished writing the wellformed predicate, but it can still be useful to create a few examples first, to help guide the constraints you write. Binary trees are a quite simple domain; imagine modeling something like the Java class system. Things can get tricky fast, and it's good to have a few concrete cases in mind.

