Let's express our two alternative BST invariants. As a reminder, they were: Version 1 For all nodes N: all left-descendants of N have a key less than N's key; and all right-descendants of N have a key greater than or equal to N's key. Version 2 For all nodes N: the left child of N (if any) has a key less than N's key; and the right child of N (if any) has a key greater than or equal to N's key. Notice that both are phrased in terms of single nodes, and should apply to all nodes. For convenience, we'll split these up into 2 predicates each: one to represent the per-node requirement, and another to represent the global requirement. pred invariant_v1[n: Node] { -- "Every node's left-descendants..." (if any) some n.left => { n.left.key < n.key all d: Node | reachable[d, n.left, left, right] => d.key < n.key } -- "Every node's right-descendants..." (if any) some n.right => { n.right.key < n.key all d: Node | reachable[d, n.right, left, right] => d.key > n.key }
}
pred binary_search_tree_v1 { binary_tree -- a binary tree, with an added invariant all n: Node | invariant_v1[n] } Here's the same pair of predicates for the second ( wrong ) invariant: pred invariant_v2[n: Node] { -- "Every node's immediate children..." some n.left implies n.left.key < n.key some n.right implies n.right.key > n.key
}
pred binary_search_tree_v2 { binary_tree -- a binary tree, with an added invariant all n: Node | invariant_v2[n]
