We'll start by defining a data type—Digit—for the wire values, which can be either T or F (short for "true" and "false"; you can also think of these as representing "1" and "0" or "high" and "low"). abstract sig Digit {}
one sig T, F extends Digit {} Then we'll define a sig for full adders, which will be chained together to form the ripple-carry adder. We'll give each full adder fields representing its input bits and output bits: sig FullAdder { -- input value bits a_in, b_in: one Digit, -- input carry bit carry_in: one Digit, -- output (sum) value sum_out: one Digit, -- output carry bit carry_out: one Digit
} Digit is not the same as boolean! Beware confusing the Digit sig we created, and the T and F values in it, with the result of evaluating Forge constraints. Forge doesn't "know" anything special about T or F; Digit is just another datatype. If we write something like (some FullAdder) = T, Forge will give an error message. This is because, to Forge, T is just another value we defined in the model. Instead, we write just (some FullAdder) to say "there is some full adder in the instance". This will come up again as we continue to develop the model. Finally, we'll define the ripple-carry adder chain: one sig RCA { -- the first full adder in the chain firstAdder: one FullAdder, -- the next full adder in the chain (if any) nextAdder: pfunc FullAdder -> FullAdder
} Reminder Recall that a pfunc field is a partial function, sort of like a dictionary: every input is mapped to at most one output. Notice that there is only ever one ripple-carry adder in an instance, and that it has fields that define which full adder comes first (i.e., operates on the 1s place), and what the succession is. We will probably need to enforce what these mean once we start defining wellformedness.

