Ok, we've looked at some of the model's output, and it seems right. But how can we be really confident that the ripple-carry adder works ? Can we use our model to verify the adder? Yes, but we'll need to do a bit more modeling. Exercise: What does it mean for the adder to "work"? Think, then click! For one thing, it had better produce a series of boolean outputs that correspond to the output we'd get if we just did the addition. That is, if we add together the numbers 2 (10) and 3 (11) we should expect to get 5—which should be 101 in binary, provided we always set the bit-width high enough to match the number of bits we're adding together. Let's augment our model to check this. We'll ask Forge for an instance where the ripple-carry adder produces a different result (taken as the sum of the outputs of each full adder) than the expected (produced via Forge's add function). When I'm expanding a model in this way, I like to augment instances with extra fields that exist just for verification , and which aren't part of the system we're modeling. Here, we'll keep track of the place-values of each full adder, which we can then use to compute the "true" value of its input or output. E.g., the first full adder would have place-value 1, and its successors would have place-value 2, then 4, etc. Helper values Sometimes you'll hear this sort of new field or value referred to as a "ghost": it isn't real; it doesn't exist in the actual system. We could store this field in the FullAdder sig, but let's keep the original unmodified, and instead add a Helper sig. This keeps the for-verification-only fields separate from the model of the system: one sig Helper { place: func FullAdder -> Int
} The ripple-carry adder gives us the context we need to speak of the place value each full adder ought to have. We can write this for the first adder easily: -- The "places" helper value should agree with the ordering that the RCA establishes.
pred assignPlaces { -- The least-significant bit is 2^0 Helper.place[RCA.firstAdder] = 1 -- ...
} Now we need to, in effect, write a for-loop or a recursive function that constrains places for all the other adders. But Forge has no recursion or loops! Fortunately, it does have the all quantifier, which lets us define every other adder's place value in terms of its predecessor: -- The "places" helper value should agree with the ordering that the RCA establishes.
pred assignPlaces { -- The least-significant bit is 2^0 Helper.place[RCA.firstAdder] = 1 -- Other bits are worth 2^(i+1), where the predecessor is worth 2^i. all fa: FullAdder | some RCA.nextAdder[fa] => { Helper.place[RCA.nextAdder[fa]] = multiply[Helper.place[fa], 2] }
} When you have quantification and helper fields, you can often avoid needing real iteration or recursion. We'll add a helper function for convenience later: fun actualValue[b: Digit, placeValue: Int]: one Int { (b = T) => placeValue else 0
}

