Let's try to express our requirement that the adder is correct. Again, we'll phrase this as: for every full adder, the true value of its output is the sum of the true values of its inputs (where "true value" means the value of the boolean, taking into account its position). We might produce something like this: pred req_adderCorrect_wrong { (rca and assignPlaces) implies { all fa: FullAdder | { actualValue[fa.sum_out, Helper.place[fa]] = add[actualValue[fa.a_in, Helper.place[fa]], actualValue[fa.b_in, Helper.place[fa]]] } }
