test expect { -- Is it _always_ true, up to these bounds, that `req_adderCorrect` always holds? r_adderCorrect: {req_adderCorrect} for 6 FullAdder, 1 RCA, 8 Int is theorem
} However, this requirement fails—Forge finds a counterexample. Exercise: What's wrong? Is the adder broken, or might our property be stated incorrectly? Think, then click! We forgot to take carrying into account! Any time a full adder carries a bit, it's dropped by the left-hand side of the above equation. Notice how even if the model (or system) is correct, sometimes the property itself is wrong. Always be skeptical about your properties, just like you're skeptical about your model. Here's another attempt: pred req_adderCorrect { (rca and assignPlaces) implies { all fa: FullAdder | { -- Include carrying, both for input and output. The _total_ output's true value is equal to -- the the sum of the total input's true value. -- output value bit + output carry bits; note carry value is *2 (and there may not be a "next adder") add[actualValue[fa.sum_out, Helper.place[fa]], multiply[actualValue[fa.carry_out, Helper.place[fa]], 2]] = -- input a bit + input b bit + input carry bit add[actualValue[fa.a_in, Helper.place[fa]], actualValue[fa.b_in, Helper.place[fa]], actualValue[fa.carry_in, Helper.place[fa]]] } }
