Checking whether or not two predicates are equivalent is the core of quite a few Forge applications---and a great debugging technique sometimes. (We saw this very briefly for binary trees, but it's worth repeating.) How do you check for predicate equivalence? Well, suppose we tried to write a predicate in two different ways, like this: pred myPred1 { some i1, i2: Int | i1 = i2
}
pred myPred2 { not all ii, i2: Int | i1 != i2
}
assert myPred1 is necessary for myPred2
assert myPred2 is necessary for myPred1 These assert statements will pass, because the two predicates are logically equivalent. But if we had written (forgetting the not): pred myPred2 { all ii, i2: Int | i1 != i2
} One of the assertions would fail, yielding an instance in Sterling you could use the evaluator with. If you get an instance where the two predicates aren't equivalent, you can use the Sterling evaluator to find out why . Try different subexpressions, discover which is producing an unexpected result!

