Classical logic provides the some and all quantifiers, but Forge also gives you no, one and lone. The no quantifier is fairly straightforward: if I write no row, col: Int | Board.board[row][col] = X, it's equivalent to all row, col: Int | Board.board[row][col] != X. That is, X hasn't yet put a mark on the board. The one quantifier is for saying "there exists a UNIQUE ...". As a result, there are hidden constraints embedded into its use. one row: Int | Board.board[row][0] = X really means, roughly, some row: Int | { Board.board[row][0] = X and all row2: Int | { row2 != row implies Board.board[row][0] != X}}: there is some row where X has moved in the first column, but only one such row . The lone quantifier is similar, except that instead of saying "exactly one", it says "either one or none". This means that interleaving one or lone with other quantifiers can be subtle. Consider what happens if I write one row, col: Int | Board.board[row][col] = X. This means that there is exactly one square on the board where X has moved. But what about one row: Int | one col: Int | Board.board[row][col] = X? Exercise: Test this out using Forge! Try running: run { not { (one row, col: Int | Board.board[row][col] = X) iff (one row: Int | one col: Int | Board.board[row][col] = X)
}} You'll get an instance showing you that the two aren't equivalent. What's the problem? Think, then click! The problem is that one row, col: Int | ... says that there exists one unique pair of indexes, but one row: Int | one col: Int | ... says that there exists one unique index such that there exists one unique index ... These are not the same. Because thinking through one and lone quantifiers can be subtle, we strongly suggest not using them except for very simple constraints. (Using them as a multiplicity, like saying one Tim.office is fine.) Satisfiability Testing and a Pitfall The test expect syntax lets you check for satisfiability directly. This is quite powerful, and lets us illustrate a fairly common mistake. Here is a test block with 2 tests in it. Both of them may look like they are comparing myPred1 and myPred2 for equivalence: test expect { -- correct: "no counterexample exists" -- Forge tries to find an instance where myPred1 and myPred2 disagree p1eqp2_A: { not (myPred1 iff myPred2) } is unsat -- incorrect: "it's possible to satisfy what i think always holds" -- Forge tries to find an instance where myPred1 and myPred2 happen to agree p1eqp2_B: { myPred1 iff myPred2 } is sat
} These two tests do not express the same thing! One asks Forge to find an instance where the predicates are not equivalent. If it can find such an instance, we know the predicates are not equivalent, and can see why by viewing the intance. The other test asks Forge to find an arbitrary instance where they are equivalent. But that needn't be true in all instances, just the one that Forge finds.

