Once someone wins a game, does their win still persist, even if more moves are made? I'd like to think so: moves never get undone, and in our model winning just means the existence of 3-in-a-row for some player. We probably even believe this property without checking it. However, it won't always be so straightforward to show that properties are preserved by the system. We'll check this one in Forge as an example of how you might prove something similar in a more complex system. Looking ahead This is our first step into the world of verification. Asking whether or not a program, algorithm, or other system always satisfies some assertion is a core problem in engineering, and has a centuries-long history. We'll tell Forge to find us pairs of states, connected by a move: the pre-state before the move, and the post-state after it. That's any potential transition in tic-tac-toe—at least, following the rules as we defined them. To apply this technique, all we need to do is add two more constraints that reflect a winner existing in the pre-state, but that there's no winner in the post-state. pred winningPreservedCounterexample { -- There is some pair of states some pre, post: Board | { -- such that the first transitions to the second some row, col: Int, p: Player | move[pre, post, row, col, p] -- the first state has a winner some p: Player | winner[pre, p] -- the second state has no winner all o: Player | not winner[post, p] }
}
run { all s: Board | wellformed[s] winningPreservedCounterexample
