Recall that our worldview for this model is that systems transition between states , and thus we can think of a system as a directed graph. If the transitions have arguments, we'll sometimes label the edges of the graph with those arguments. This view is sometimes called a discrete event model, because one event happens at a time. Here, the events are moves of the game. In a bigger model, there might be many different types of events. Today, we'll ask Forge to find us full traces of the system , starting from an initial state. We'll also add a Game sig to incorporate some metadata. -- Generate *one* game of tic-tac-toe
one sig Game { -- What state does the game start in? initialState: one Board, -- How does the game evolve from state to state? nextState: pfunc Board -> Board
} pred traces { -- The trace starts with an initial state starting[Game.initialState] no sprev: Board | Game.nextState[sprev] = Game.initialState -- Every transition is a valid move all s: Board | some Game.nextState[s] implies { some row, col: Int, p: Player | move[s, row, col, p, Game.nextState[s]] }
} By itself, this wouldn't be quite enough; we might see a bunch of disjoint traces. We could add more constraints manually, but there's a better option: tell Forge, at runtime, that nextState represents a linear ordering on states. This is similar to what we did back in the ripple-carry adder : run { traces } for {nextState is linear} It's worth recalling what's happening here. The phrase nextState is linear isn't a constraint ; it's a separate annotation given to Forge alongside a run or a test. Never put such an annotation in a constraint block; Forge won't understand it. These annotations narrow Forge's bounds (the space of possible worlds to check) before the solver begins its work. In general, Forge syntax allows such annotations after numeric bounds. E.g., if we wanted to see full games, rather than unfinished game prefixes (the default bound on any sig, including Board, is up to 4) we could have asked: run { traces
} for exactly 10 Board for {nextState is linear} You might notice that because of this, some traces are excluded. That's because nextState is linear forces exact bounds on Board. This is in contrast to plinear, which we used for the ripple-carry adder, and which didn't force exact bounds. Use whichever of the two is more appropriate to your needs.

