Recall that we just ran this command: run { wellformed traces
} for exactly 10 Board for {nextState is linear} Nothing without a command Without a run, an example, or a similar command , running a Forge model will do nothing. From this run command, Forge will find traces of the system (here, games of Tic-Tac-Toe) represented as a linear sequence of exactly 10 State atoms. Do you have any worries about the way this is set up? Think, then click!
Are all Tic-Tac-Toe games 10 states long? Well, maybe ; it depends on how we define a game. If we want a game to stop as soon as nobody can win, our exactly 10 State bound is going to prevent us from finding games that are won before the final cell of the board is filled. Let's add the following guard constraint to the move transition predicate, which forces games to end as soon as somebody wins. all p: Player | not winner[pre, p] Now we've got problems, because once we add this constraint, Forge will omit games that end before all square of the board are filled. This behavior, which may initially seem strange, exists for two reasons: History: Forge's ancestor language, Alloy, has something very similar to is linear, with the same semantics. Performance: since the is linear annotation is almost always used for trace-generation, and trace-generation solving time grows (in the worst case) exponentially in the length of the trace, we will almost always want to reduce unnecessary uncertainty. Forcing the trace length to always be the same reduces the load on the solver, and makes trace-generation somewhat more efficient. But now we need to work around this limitation. Any ideas? Hint: do we need to have only one kind of transition in our system? Think, then click! No. A common way to allow trace length to vary is by adding a "do nothing" transition. (In the literature, this is called a stutter transition .) The trick is in how to add it without also allowing a "game" to consist of nobody doing anything. To do that requires some more careful modeling. Let's add an additional transition that does nothing. We can't "do nothing" in the predicate body, though—an empty predicate body would just mean anything could happen. What we mean to say is that the state of the board remains the same, even if the before and after Board objects differ. pred doNothing[pre: Board, post: Board] { all row2: Int, col2: Int | post.board[row2][col2] = pre.board[row2][col2]
} Variable names Remember that row2 and col2 are just variable names that could stand for any Int; they aren't necessarily the row or column index value 2. We also need to edit the traces predicate to allow doNothing to take place: pred traces { -- The trace starts with an initial state starting[Game.initialState] no sprev: Board | Game.nextState[sprev] = Game.initialState -- Every transition is a valid move all s: Board | some Game.nextState[s] implies { some row, col: Int, p: Player | { move[s, row, col, p, Game.nextState[s]] } or doNothing[s, Game.nextState[s]] } } As it stands, this fix solves the overconstraint problem of never seeing an early win, but introduces a new underconstraint problem: we don't want doNothing transitions to happen just anywhere! Here's how I like to fix it: pred gameOver[s: Board] { some p: Player | winner[s, p]
} Why a new predicate? Because I want to use different predicates to represent different concepts, and enable re-use. When should a doNothing transition be possible? Only when the game is over! pred doNothing[pre: State, post: State] { gameOver[pre] -- guard of the transition pre.board = post.board -- effect of the transition
} If we wanted to, we could add a not gameOver[pre] guard constraint to the move predicate, enforcing that nobody can move at all after someone has won.

