Overconstraint bugs, where some instances may be unintentionally ruled out by our model, can be a nightmare to detect and fix. Maybe you wrote an assert and it seemed to never stop. Maybe you wrote a run command and Forge just produced an UNSAT result—after a long wait. Getting back an unsat result can take a long time. Why? Think of the search process. If there is a satisfying instance, the solver can find it early. If there isn't, the solver needs to explore the entire space of possibilities. There are smart algorithms for this, and the solver is not really enumerating the entire space of instances, but the general idea holds. So if you run Forge and it doesn't seem to ever terminate, it's not necessarily a Forge problem. Overconstraint bugs can produce this behavior, too. So, how do you debug a problem like this? The first thing I like to do is reduce the bounds (if possible) and, if I still get unsat, I'll use that smaller, faster run to debug. But at that point, we're kind of stuck. UNSAT isn't very helpful. Today I want to show you a very useful technique for discovering the problem. There are more advanced approaches we'll get to later in the course, but for now this one should serve you well. TODO: insert unsat core, now that we have good highlighting! The idea is: encode an instance you'd expect to see as a set of constraints, run those constraints only, and then use the evaluator to explore why it fails your other constraints. Let's do an example! TODO: this is taken from a homework, not one of the above... should rewrite #lang froglet sig State { top: lone Element
}
sig Element { next: lone Element } pred buggy { all s: State | all e: Element { s.top = e or reachable[e, s.top, next] } some st1, st2: State | st1.top != st2.top all e: Element | not reachable[e, e, next]
}
test expect { exampleDebug: {buggy} is sat
} This test fails. But why? run { some st1, st2: State | some ele1, ele2: Element | { st1.top = ele1 st2.top = ele2 ele1.next = ele2 no ele2.next }
} for exactly 2 State, exactly 2 Element Given this instance, the question is: why didn't Forge accept it? There must be some constraint, or constraints, that it violates. Let's find out which one. We'll paste them into the evaluator... some st1, st2: State | st1.top != st2.top? This evaluates to #t (true). No problem there. all s: State | all e: Element { s.top = e or reachable[e, s.top, next] }? This evaluates to #f (false). So this is a problem. Now we proceed by breaking down the constraint. The outer shell is an all, so let's plug in a concrete value: all e: Element { State0.top = e or reachable[e, State0.top, next] }? This evaluates to #f. So the constraint fails for State0. Important : Don't try to name specific states in your model. They don't exist at that point. Which element does the constraint fail on? Again, we'll substitute concrete values and experiment: State0.top = Element0 or reachable[Element0, State0.top, next]? This evaluates to #t. What about State0.top = Element1 or reachable[Element1, State0.top, next]? Following this process very often leads to discovering an over-constraint bug, or a misconception the author had about the goals of the model or the meaning of the constraints. Question: What's the problem here? Think, then click! Since the next field never changes with time, the all constraint doesn't allow states to vary the top of the stack. Instead, we need a weaker constraint to enforce that the stack is shaped like a state.

