TODO: should this part go to the Q and A for traces? Where an assert or run is about checking satisfiability or unsatisfiability of some set of constraints, an example is about whether a specific instance satisfies a given predicate. This style of test can be extremely useful for checking that (e.g.) small helper predicates do what you expect. Why use example at all? A couple of reasons: It is often much more convenient (once you get past the odd syntax) than adding one sigs or some quantification for every object in the instance, provided you're trying to describe an instance rather than a property that defines a set of them---which becomes a better option as models become more complex. Because of how it's compiled, an example can sometimes run faster than a constraint-based equivalent. You may be wondering whether there's a way to leverage that same speedup in a run command. Yes, there is! But for now, let's get used to the syntax just for writing examples. Here are some, well, examples: pred someXTurn {some s: State | XTurn[s]}
example emptyBoardXturn is {someXTurn} for { State = `State0 no `State0.board
} Here, we've said that there is one state in the instance, and its board field has no entries. We could have also just written no board, and it would have worked the same. -- You need to define all the sigs that you'll use values from
pred someOTurn {some b: Board | OTurn[b]}
example xMiddleOturn is {someOTurn} for { Board = `Board0 Player = `X0 + `O0 X = `X0 O = `O0 `Board0.board = (1, 1) -> `X0
} What about assertions, though? You can think of assertions as generalizing examples. I could have written something like this: pred someXTurn {some b: Board | xturn[b]}
pred emptySingleBoard { one b: Board | true all b: Board, r,c: Int | no b.board[r][c]
}
assert emptySingleBoard is sufficient for someXTurn That's pretty coarse-grained, though. So let's write it in a better way: pred emptyBoard[b: Board] { all r, c: Int | no b.board[r][c] }
assert all b: Board | emptyBoard[b] is sufficient for xturn[b] Notice how, by adding variables to the assertion, we're able to write less-verbose assertions and re-use our predicates better. But if examples are faster, why use assertions? First, examples aren't always faster. There are also some models we'll write later where example isn't supported. And, of course, as the model becomes more complex, the example becomes longer and longer as you try to define the value of all fields. But there's a more important reason: assertions can express properties . Because they can state arbitrary constraints, there's an analogy to property-based testing: where examples are like traditional unit tests, assertions are like the checker predicates you wrote in Hypothesis. So there's a role for both of them.

