This technique isn't only applicable in Forge. It's used in many other solver-based tools, including those used in industry. And modeling linked lists in Forge is very doable, but more complicated than I'd like to do at this point. So we'll demonstrate the idea on the tic-tac-toe model. Step 1: are there any bad states that are also starting states? assert all b: Board | initial[b] is sufficient for balanced[b] for 1 Board, 3 Int Notice that we didn't need to use the next is linear annotation, because we're not asking for traces at all. We've also limited our scope to exactly 1 Board. We also don't need 4 integer bits; 3 suffices. This should be quite efficient. It should also pass, because the empty board isn't unbalanced. Step 2: are there any transitions from a good state to a bad state? Again, we don't need a full trace for this to work. We only need 2 boards: the pre-state and post-state of the transition: pred moveFromBalanced[pre: Board, row, col: Int, p: Player, post: board] { balanced[pre] move[pre, row, col, p, post]
}
assert all pre, post: Board, row, col: Int, p: Player | moveFromBalanced[pre, row, col, p, post] is sufficient for balanced[post] for 2 Board, 3 Int If both of these pass, we've just shown that bad states are impossible to reach via valid moves of the system. Aside: Performance That second step is still pretty slow on my laptop: around 10 or 11 seconds to yield UNSAT. Can we give the solver any help? Hint: is the set of possible values for pre bigger than it really needs to be? Think, then click! If we assume the pre board is well-formed, we'll exclude transitions involving invalid boards. There are a lot of these, even at 3 Int, since row and column indexes will range from -4 to 3 (inclusive). We could do this either by asserting wellformed[pre] or by refining the bounds we give Forge.
